(1, 'Vanitas no Carte 2nd Season', 'Vanitas no Carte 2nd Season', 'full', 1, 'Chủ đề cho movie mới này sẽ là về \"Saiyan\", cuộc ganh đua để dành được dành được danh hiệu bá chủ vũ trụ. Kể từ sau \"Battle of Gods\" Goku đã có được nhiều sức mạnh từ Super Saiyan God đến Super Saiyan Blue, và thêm nhiều cấp độ mới trong trận đấu chống lại những kẻ mạnh đến từ những vũ trụ khác. Câu truyện mới lần này sẽ tập trung vào nguồn gốc sức mạnh của người Saiyan và hiểu Saiyan là gì.', ' Nagamine Tatsuya', '2018', 1277107, 'HD', '24', 5, 9, 0, 'https://animevi.net/image/poster/8471631902145.jpg', '', 1, '??', ' THỨ 4 HÀNG TUẦN'),
(2, 'Thám Tử Lừng Danh Conan', 'Thám Tử Lừng Danh Conan', 'full', 1, 'Mở đầu câu truyện, cậu học sinh trung học 17 tuổi (trong truyện tranh là 16) Shinichi Kudo (Jimmy Kudo) bị biến thành cậu bé Conan Edogawa. Shinichi trong phần đầu của Thám tử lừng danh Conan được miêu tả là một thám tử học đường. Trong một lần đi chơi công viên \"Miền Nhiệt đới\" với cô bạn từ thuở nhỏ (cũng là bạn gái) Ran Mori (Rachel Moore), cậu bị dính vào vụ án một hành khách trên Chuyến tàu tốc hành trong công viên, Kishida (Kenneth), bị giết trong một vụ án cắt đầu rùng rợn. Cậu đã làm sáng tỏ vụ án và trên đường về nhà, chứng kiến một vụ làm ăn mờ ám của những người đàn ông mặc toàn đồ đen. Kudo bị phát hiện, bị đánh ngất sau đó những người đàn ông áo đen đã cho cậu uống một thứ thuốc độc chưa qua thử nghiệm là Apotoxin-4869 (APTX4869) với mục đích thủ tiêu cậu. Tuy nhiên chất độc đã không giết chết Kudo. Khi tỉnh lại, cậu bàng hoàng nhận thấy thân thể mình đã bị teo nhỏ trong hình dạng của một cậu học sinh tiểu học.', '', '2001', 45763, 'HD', '24', 5, 9, 0, 'https://media.tinmoi.vn/2016/11/19/HINH1.jpg', '', 24, '24', ' THỨ 4 HÀNG TUẦN'),
(3, 'Ousama Ranking', 'Ousama Ranking', 'full', 1, 'Phim xoay quanh Bojji, một hoàng tử bị điếc, bất lực, thậm chí không thể sử dụng thanh kiếm của trẻ em. Là con trai đầu lòng, anh phấn đấu hết mình và ước mơ trở thành vị vua vĩ đại nhất thế giới. Tuy nhiên, mọi người đồn thổi về anh sau lưng anh là \"một hoàng tử chẳng ra gì\" và \"không thể nào anh có thể làm vua được.\" Bojji có thể kết bạn đầu tiên của mình, \"Kage\" (bóng tối) —một cái bóng theo nghĩa đen trên mặt đất, người bằng cách nào đó hiểu rõ Bojji. (Kage là một người sống sót trong gia tộc sát thủ Kage đã bị xóa sổ. Không còn là một kẻ giết người, Kage giờ đây kiếm sống bằng cách ăn trộm.) với cuộc gặp gỡ định mệnh của mình với Kage.', 'Nanae_Chrono', '2017', 247838, 'HD', '24', 5, 9, 0, 'https://jpsharing.net/wp-content/uploads/2021/12/Ranking-of-Kings-jpsharing.net_.jpg', '', 12, '??', ' THỨ 4 HÀNG TUẦN'),
(4, 'Saiyuuki Reload: Even a Worm Arc, Saiyuki RELOAD -ZEROIN', 'Saiyuuki Reload: ZeroinTSUKIKAGE RAN', 'full', 1, 'Xưa kia, vùng đất Togenkyo là một vùng đất yên bình, nơi con người và yokai cùng chung sống. Tuy nhiên, sau đó, những người đàn ông xuất hiện - những người cố gắng hồi sinh Gyumaoh, Đại Yokai, người đã bị chiến thần Nataku Taishi giết và chôn cất trong lâu đài Houtou 500 năm trước. Bằng cách sử dụng một sự kết hợp cấm của hóa học và ma thuật. Sóng năng lượng tiêu cực được tạo ra lan truyền khắp Togenkyo, khiến yokai phát điên và tấn công nhân loại. Để cứu vùng đất, Kanzeon bosatsu ra lệnh cho Son Goku, Genjyo Sazno, Sha Gojyo và Cho Hakkai đi về phía tây. Cả bốn bắt đầu một cuộc hành trình để ngăn chặn cuộc thí nghiệm để hồi sinh Gyumaoh. Trên đường đi, họ gặp Hazel Grouse, người sử dụng phép thuật kỳ lạ sử dụng linh hồn yokai để hồi sinh người chết, và là môn đồ của anh ta là Gato. Hai người họ tham gia bữa tiệc. Và Ukoku Sanzo, một người đàn ông mà họ có một lịch sử lâu đời, tiếp cận trong bóng tối ...Các nhân vật khó quên, kịch tính cá nhân căng thẳng và hành động tuyệt vời trong một câu chuyện về mối quan hệ giữa bốn người đàn ông!', 'Đang cập nhập', '2000', 16531, 'HD', '24', 5, 9, 0, 'https://uploads.mangadex.org/covers/b30540c7-bde6-4279-9645-a3eddc5c9e97/22e8a00e-e9dc-48cd-867d-a3953c789c15.jpg.512.jpg', '', 2, '??', ' THỨ 4 HÀNG TUẦN'),
(5, 'One Piece', 'Vua hải tặc luffy, Đảo Hải Tặc', 'Đang phát hành', 1, 'Monkey D. Luffy, 1 cậu bé rất thích Đảo hải tặc có ước mơ tìm được kho báu One Piece và trở thành Vua hải tặc - Pirate King. Lúc nhỏ, Luffy tình cờ ăn phải trái quỉ (Devil Fruit) Gomu Gomu, nó cho cơ thể cậu khả năng co dãn đàn hồi như cao su nhưng đổi lại cậu sẽ không bao giờ biết bơi. Sau đó Luffy lại được Shank cứu thoát tuy nhiên ông ta bị mất 1 cánh tay. Sau đấy Shank chia tay Luffy và để lại cho cậu cái mũ rơm (Straw Hat) và nói rằng: Sau này bao giờ thành cướp biển hãy gặp ta và trả lại nó. Chính lời nói này đã thúc đầy Luffy trở thành 1 cướp biển thật sự.\n\nHãy cùng theo dõi xem liệu Luffy có thể trở thành đạt được kho báu One Piece và trở thành Vua Hải Tặc không nhé.', 'Đang cập nhập', 'Đang cập nhập', 133078, 'HD', '20', 5, 9, 0, 'https://static.vieon.vn/vieplay-image/thumbnail_v4/2021/02/24/969yubax_1920x1080-onepiece.jpg', '', 1005, '??', ' THỨ 7 HÀNG TUẦN'),
(6, 'Dragon Quest: Dai no Daibouken', 'Dragon Quest: Dai no Daibouken', 'full', 1, 'Từ rất xa xưa, có một vị kiếm khách chính nghĩa được gọi là dũng sĩ đã trải qua bao cuộc chiến đấu với ma vương để giải thoát con người khỏi những đau khổ. Vị dũng sĩ và những người bạn sau khi cùng nhau liên kết sức mạnh, vượt qua rất nhiều trận đấu cam go. Cuối cùng ma vương cũng đã bị đánh bại. Nhờ vậy, những bọn ma thú, tuy thuộc hạ nhưng chúng ghét việc phục tùng ma vương đã được con người giải thoát khỏi sự thao túng của ác quỷ. Và chúng đến một nơi không làm phiền đến ai để chung sống hòa bình. Và nơi đó chính là hòn đảo Derumuriso chơ vơ ở vùng biển phía Nam.\n\nVài năm sau, con ác ma đó được hồi sinh. Bấy giờ, nhân vật chính của chúng ta, Dai, sống trên một hòn đảo xa xôi ở vùng biển phía Nam và ước mơ trở thành một vị dũng sĩ vĩ đại. Khi cậu ta nghe tin về sự hồi sinh của tên ác ma đó, Dai cùng với những người bạn hành động để ngăn chặn hắn và thế lực tà ác đã hồi sinh hắn. Trên đường đi, Dai khám phá ra danh tính của vị “anh hùng” kia, sự thật đằng sau thế lực xấu xa đã hồi sinh con quỷ và cả sức mạnh tiềm ẩn của chính Dai những lúc cậu gặp nguy hiểm.', 'Đang cập nhập', '2011', 19865, 'HD', '93', 5, 9, 0, 'https://seishunki9x.files.wordpress.com/2020/09/118795173_1974641545999807_3875091756637487097_o.jpg', '', 64, '??', ' THỨ 4 HÀNG TUẦN'),
(7, 'Thế Giới Hoàn Mỹ', 'Thế Giới Hoàn Mỹ', 'full', 1, 'Tại Kinh Châu, Trung Quốc.\nMột cuốn sách lịch sử ghi chép về thời đại Tam Quốc viết rằng, nơi đây đã từng là một vùng đất chiến tranh bất tận.\nMột nam sinh Cao Trung tên Tôn Thần, vốn ghét lịch sử về nơi mà cậu sinh sống, đã gặp vài vấn đề về 1 giấc mơ nhất định.\nSau khi tỉnh giấc khỏi giấc mơ, những việc lạ lùng lần lượt diễn ra, khi chưa kịp nắm bắt vấn đề, thì cậu đột nhiên đã phải đối mặt với Diên (Ngụy Diên), một trong những vị tưởng từ thời Tam Quốc, người đang có ý định giết cậu ta!\nNgay trước khi Diên vung thanh đại đao của mình xuống, một mỹ nhân kỳ bí đã xuất hiện trước mặt Tôn Thần.\nThử thách gì đang đón chờ Tôn Thần, khi cậu phải chứng kiến một trận đánh kinh hoàng giữa 2 vị tướng từ thời Tam Quốc?!', 'Đang cập nhập', '2016', 147382, 'HD', '14', 5, 9, 0, 'https://vcdn.kenhgamevn.com/wp-content/uploads/2021/09/29060946/game4v-the-gioi-hoan-my-2-1632366655-71.jpeg', '', 78, '??', ' THỨ 4 HÀNG TUẦN'),
(8, 'Thôn Phệ Tinh Không', 'Thôn Phệ Tinh Không', 'full', 1, 'Một ngày nọ, thế giới xuất hiện loại virus RR không rõ lai lịch, cuốn thế giới vào thảm hoạ. Động vật bị truyền nhiễm đột biến thành quái thú đáng sợ, xâm lược với số lượng lớn. Trong lúc loài người đối mặt với diệt vong, họ đã xây lên bức tường bao vây, thành lập căn cứ làm pháo đài cuối cùng bảo vệ con người. \n\nTrong thời gian này, con người nếm trải đủ mọi khó khăn, được gọi là “thời kỳ Đại Niết Bàn”. Trong môi trường sinh tồn cực đoan, bản năng của con người cũng dần phát triển, ngọn gió thượng võ phất lên, tố chất cơ thể con người vượt trội hơn trước. Mà trong những người xuất sắc, được gọi là “chiến binh”. La Phong năm 18 tuổi cũng ước mơ trở thành một trong số họ. Cậu lúc này sắp phải thi đại học, đang đối diện với sự lựa chọn giữa ngã tư đời người. Nhưng lại bị quái thú tấn công ảnh hưởng quỹ đạo cuộc đời của cậu hết lần này đến lần khác. \n\nDưới uy hiếp của quái thú, cư dân trong thành phố đối diện với nguy hiểm, quân sự lại bó tay. Duy chỉ có chiến binh xông pha, bảo vệ an toàn cho căn cứ. La Phong được những chiến binh truyền cảm hứng, âm thầm hạ quyết tâm trở thành chiến binh bảo vệ người mình yêu thương. Đây chính là khởi đầu của mọi thứ, khởi điểm của  con đường chiến binh La Phong, cũng vén bức màn cuộc đời truyền kì của cậu. La Phong lập chí trở thành chiến binh. Con đường phía không dễ dàng, đầu tiên cậu phải đối diện với môi trường ngoại bộ, vô hình chung càng thêm ảnh hưởng tới cậu. Gia đình La Phong có điều kiện không tốt, cuộc sống túng thiếu, bố mẹ không thể giúp đỡ cậu được nhiều, cậu đành dựa vào nỗ lực của bản thân. ', 'Noriyuki Abe', '2006', 198114, 'HD', '133', 5, 9, 0, 'https://1.bp.blogspot.com/-AXVRv3y-wNY/X8m7xbz1h9I/AAAAAAAAAWg/IVosMD4JdpglFtnayZ2joncHG-lrFJajgCLcBGAsYHQ/w312-h438/thon-phe-tinh-khong.jpg', '', 30, '60', ' THỨ 4 HÀNG TUẦN'),
(9, 'Tử Xuyên', 'Tử Xuyên', 'full', 1, 'Hoạt hình “Tử Xuyên” cải biên từ bộ tiểu thuyết cùng tên của Lão Sai Thông, do Tencent video sản xuất. Bộ phim hoạt hình kể về thần thoại Tây Châu Đại Lục, truyền kì máu lửa qua từng thời đại: Trong đế quốc của loài người, gia tộc thần bí ở phương Đông xa xôi, Tử Xuyên Tam Kiệt phất lên! Anh cả Đế Lâm chín chắn đa mưu, tàn khốc lí trí, anh hai Sterling chỉ huy một đội quân, có lòng trung thành với nước, em út Tử Xuyên Tú bị người đời gọi với cái tên “Vô Lại”, trí dũng song toàn. Gia tộc Tử Xuyên loạn trong giặc ngoài, Tử Xuyên Tam Kiệt mỗi người đều có thế mạnh riêng: Trong thời khắc nước sôi lửa bỏng, đánh bại Ma tộc hung ác, xông vào hang hổ truy sát tên phản đồ Lôi Hồng đến cùng; Tư Đặc Lâm lấy gia tộc làm gốc, vừa vô tình vừa trọng tình lưu luyến người yêu... Loài người, Ma tộc, Thú tộc. Mỗi tộc ở mỗi phương khác nhau, tranh chấp lẫn nhau trên mảnh đất Đại Lục này, xích mích không ngừng. Khi máu và lửa hòa vào nhau, đao và kiếm va chạm, tạo ra câu chuyện sử thi bi tráng-Tử Xuyên. Bộ phim hoạt hình miêu tả một thế giới độc đáo kì diệu. Thể hiện từng nhân vật có tính cách khác nhau ra, viết nên một khúc bi ca vừa hoành tráng vừa bi thương.', ' Toshifumi Takizawa', '2021', 148065, 'HD', '26', 5, 9, 0, 'https://lh3.googleusercontent.com/-Yo5K9ATmv9s/Ydjxz27NKBI/AAAAAAAAAqw/9fTPAdBLvQMLr_Fgv0JTZpbqcnIB20hLACNcBGAsYHQ/s0/tu-xuyen.webp', '', 5, '??', ' THỨ 4 HÀNG TUẦN'),
(10, 'Platinum End', 'Platinum End', 'full', 1, 'Khi các bạn cùng lớp ăn mừng lễ tốt nghiệp cao trung, Mirai đã gặp rắc rối chìm trong bóng tối. Nhưng trận chiến của cậu ta chỉ mới bắt đầu khi nhận được sự cứu rỗi nào đó từ thiên giới dưới hình dạng một thiên thần. Giờ đây, Mirai đang đọ sức với 12 người được chọn khác trong một trận chiến mà người chiến thắng trở thành vị thần tiếp theo của thế giới. Mirai có một thiên thần trong thể xác của mình, nhưng cậu có thể cần phải trở thành ác quỷ để tồn tại.', 'Đang cập nhập', '2004', 148065, 'HD', '26', 5, 9, 0, 'https://animeweb.xyz/wp-content/uploads/2021/09/platinum-end.jpg', '', 12, '12', ' THỨ 4 HÀNG TUẦN'),
(11, 'Yêu Thần Ký', 'Yêu Thần Ký', 'full', 1, 'Nie Li, Chiến Sĩ Thần Quỷ mạnh nhất, trong quá khứ của mình, anh ta đang đứng ở đỉnh cao của thế giới. Tuy nhiên, anh ta đã bị mất cuộc sống của mình trong trận chiến với các Hoàng Đế, Nhà Hiền Triết và Sáu Vị Thần Thú, linh hồn của anh ấy đã được tái sinh sau đó và trở lại quá khứ khi anh 13 tuổi. Mặc dù anh ta là người yếu nhất trong lớp học của mình và với tài năng thấp nhất, còn linh hồn đạt cảnh giới cao nhất, nhưng với sự hiểu biết mà anh ấy đã tích lũy được từ cuộc sống trước đây của mình, anh đã được đào tạo nhanh hơn bất cứ ai khác. Anh ta cố gắng bảo vệ thành phố mà trong tương lai sắp tới bị tấn công bởi Cơn Gió Tuyết do Thần Quỷ Tuyết tạo ra và cuối cùng thành phố bị phá hủy cũng như người anh ấy yêu, bạn bè và gia đình của anh đã chết trong cuộc chiến. Đọc Đi Rồi Bít Diễn Biến Ra Sao!!!!', 'Đang cập nhập', '2021', 148065, 'HD', '26', 5, 9, 0, 'https://zingaudio.net/wp-content/uploads/2020/10/yeu-than-ky.jpg', '', 196, '??', ' THỨ 4 HÀNG TUẦN'),
(12, 'Doraemon Movie [01-35]', 'Doraemon Movie [01-35]', 'full', 1, 'Tổng hợp lại 1 link cho dễ xem, đây tập hợp đầy đủ từ movie 1 cho tới 35 của nhóm 3F', 'Đang cập nhập', '2004', 148065, 'HD', '26', 5, 9, 0, 'https://animeaz.net/zip/uploads/doraemon-movie-01-36-thumbnail.jpg.webp', '', 1, '1', ' THỨ 4 HÀNG TUẦN'),
(13, 'Owari no Seraph SS2', 'Owari no Seraph SS2', 'full', 1, 'Owari no Seraph SS2 là một bộ anime thuộc thể loại dark fantasy được chuyển thể dựa trên một bộ manga cùng tên của tác giả Kagami Takaya. Bộ anime này có cốt truyện tương đối đen tối và mang tính chất hậu tận thế với bối cảnh sau khi toàn bộ người lớn trên thế giới đều bị tiêu diệt bởi một loại virus bí ẩn, còn trẻ em lại trở thành nguồn lương thực sống cho các bộ tộc vampire. \n\nKhán giả sẽ được theo chân nhân vật nam chính Hyakuya Yuichiro trong cuộc chiến chống lại những thế lực của bóng tối với những thành viên thuộc Moon Demon Company. ', 'Đang cập nhập', '2004', 148065, 'HD', '26', 5, 9, 0, 'https://image.hayghe.org/data/film/Owari-no-Seraph-SS2-TV.jpg', '', 22, '22', ' THỨ 4 HÀNG TUẦN'),
(14, 'HITOHIRA', 'HITOHIRA', 'full', 1, 'Asai Mugi vừa bước vào học viện Mĩ thuật Kumataka, cô bé gặp rắc rối trong việc nói chuyện mỗi khi có việc gì đó xảy đến làm cô bé hoảng sợ. Bị các senpai trong club hội Nghiên Cứu Kịch ép tham gia, cô bé đã dần dần thay đổi mình dưới sự tác động mạnh mẽ từ những thành viên trong club.', 'Đang cập nhập', '2004', 148065, 'HD', '26', 5, 9, 0, 'https://i1.sndcdn.com/artworks-S38UVOvyamcWcKM7-yjXlyQ-t500x500.jpg', '', 12, '12', ' THỨ 4 HÀNG TUẦN'),
(15, 'HUNTER X HUNTER THE MOVIE 2 - THE LAST MISSION', 'HUNTER X HUNTER THE MOVIE 2 - THE LAST MISSION', 'full', 1, 'Các Hunter mạnh nhất của Hiệp Hội Hunter đã chia ra thành hai phần, \"bóng tối\" và \"ánh sáng\", và mỗi bên trong bọn họ tự đi trên con đường riêng của mình. \"Mặt tối\" dần dần trở thành một thế lực truy sát các Hunters. Sau một cuộc tấn công dữ dội của Hunter \"bóng tối\", Killia bị trọng thương và Kurapika gần như sắp chết đến nơi. Mục đích thật sự sau các vụ tấn công các Hunters là gì? Giờ đây, những tội ác của Netero và của Hiệp Hội đều được thông báo rộng rãi. Liệu rằng Gon có thể giải quyết được \"bóng tối\" kia và cứu rỗi lấy bạn bè của mình? Gon sẽ phản ứng ra sao khi biết được tội ác đằng sau Netero và Hiệp Hội Hunter...', 'Đang cập nhập', '2004', 148065, 'HD', '26', 5, 9, 0, 'https://i.imgur.com/5RoYWqLm.jpg', '', 1, '1', ' THỨ 4 HÀNG TUẦN'),
(16, 'AKAME GA KILL!', 'AKAME GA KILL!', 'full', 1, 'Câu chuyện Akame ga Kill xoay quanh Tatsumi, một thanh niên trẻ tuổi đầy nhiệt huyết.Vốn xuất thân từ nông thôn nhưng có chút ít năng lực võ nghệ, cậu lên thủ đô với mục đích kiếm tiền gầy dựng lại ngôi làng của mình. Chỉ để rồi khám phá ra cái xã hội mục nát đang ăn sâu vào con người và đất nước, ẩn chứa qua vẻ đẹp hào nhoáng của chốn phồn hoa đô thị. Trong hoàn cảnh bế tắc của Akame ga Kill, làm cậu mất định hướng cho tương lai, thì một nhóm sát thủ với tên gọi “Night Raid” có lời mời kết nạp. Và cuộc chiến chống lại đế chế thối nát nhằm mang đến công lý bên cạnh những người bạn sát thủ diễn ra trong Akame ga Kill', 'Đang cập nhập', '2004', 148065, 'HD', '26', 5, 9, 0, 'https://weblinhtinh.net/wp-content/uploads/2021/09/akame-ga-kill.jpg', '', 24, '24', ' THỨ 4 HÀNG TUẦN'),
(17, 'SWORD ART ONLINE II - GUN GALE ONLINE', 'SWORD ART ONLINE II - GUN GALE ONLINE', 'full', 1, 'Đã một năm kể từ khi  được Sword Art Online II clear, Kikouta đã đề nghị Kirito khám phá Gun Gale Online, hay cụ thể hơn là Death Gun - một vũ khí có khả năng liên kết cái chết từ trong thế giới ảo ra ngoài thế giới thực. \nKhi vào Game, Sinon đã chỉ dạy cho Kirito các ràng buộc của SAO - GGO. Sau đó cả hai cùng tham gia đại hội Gun Gale Online, Bullet of Bullets. Mặc dù chỉ là Newbie nhưng Kirito đã thể hiện được các kỹ năng rất cao cường. Cậu đã điều tra những cái chết kỳ lạ có liên quan tới một Xích Hội tên là Laughing Coffin ở trong Sword Art Online II .', 'Đang cập nhập', '2004', 148065, 'HD', '26', 5, 9, 0, 'https://i.pinimg.com/originals/17/6f/ea/176fea72e0472849f1b057bc82bca676.jpg', '', 24, '24', ' THỨ 4 HÀNG TUẦN'),
(18, 'NARUTO SD ', 'NARUTO SD ', 'full', 1, 'Rock Lee và con đường Ninja là một series Anime Naruto lấy nhân vật chính là Rock Lee, các nhân vật được Chibi hóa tới mức đáng yêu, ngộ nghĩnh. Bộ phim Naruto Vietsub được vẽ bởi Kenji Taira - một trợ lý của Mashashi Kishimoto (tác giả Naruto) và được đạo diễn bởi Masahiko Murata..', 'Đang cập nhập', '2004', 148065, 'HD', '26', 5, 9, 0, 'https://s199.imacdn.com/vg/2015/05/naruto-sd-large-1432285036.jpg', '', 51, '51', ' THỨ 4 HÀNG TUẦN'),
(19, 'KATANAGATARI', 'KATANAGATARI', 'full', 1, 'Thợ rèn kiếm huyền thoại Shikizaki Kiki đã rèn ra 1000 thanh kiếm trong sự nghiệp của ông. Người nào thâu tóm càng nhiều kiếm trong tay, khả năng chiến thắng của người đó sẽ càng cao. Khi Mạc phủ chiến thắng, họ đã thu về được 988 thanh kiếm... nhưng thực tế, chúng chỉ là những thanh kiếm thử nghiệm. 12 thanh cuối cùng mới thật sự là bảo kiếm. Mỗi thanh đều ẩn chứa trong mình một quyền năng phi thường, mang lại cho chủ nhân của nó sức mạnh có thể địch lại cả một quân đội. Mạc phủ đã tức tốc phái chiến lược gia Togame lên đường tìm 12 thanh bảo kiếm đó. Sau khi thuê một ninja và bị hắn phản bội, thuê một kiếm sĩ và lại bị cướp mất bảo kiếm, cô đã phải tìm đến hi vọng cuối cùng: Vô kiếm phái. Kiếm phái từng xưng bá thời chiến quốc, một kiếm phái... không dùng kiếm.', 'Đang cập nhập', '2004', 148065, 'HD', '26', 5, 9, 0, 'https://s1.boctem.com/wp-content/uploads/2021/02/50023.jpg', '', 12, '12', ' THỨ 4 HÀNG TUẦN'),
(20, 'CHROME SHELLED REGIOS', 'CHROME SHELLED REGIOS', 'full', 1, 'Phim dành cho đối tượng trên 16 tuổi. Dựa trên light novel cùng tên. Câu chuyện diễn ra trong tương lai, khi thế giới đang bị những sinh vật làm ô nhiễm “pollutant” đẩy loài người vào một thành phố di động mang tên Regios. Lei-Fon Alseif, một học sinh năm 1 phổ thông, đã miễn cưỡng tham gia vào đơn vị nghiên cứu võ thuật 17 do một sinh viên năm cuối Nina Antouku dẫn đầu chống lại những “Pollutant Beasts”.', 'Đang cập nhập', '2004', 148065, 'HD', '26', 5, 9, 0, 'https://i.pinimg.com/originals/ee/0b/3a/ee0b3aed00a79574715e64c2109d3bba.jpg', '', 24, '24', ' THỨ 4 HÀNG TUẦN'),
(21, 'KENYUU DENSETSU YAIBA', 'KENYUU DENSETSU YAIBA', 'full', 1, 'Yaiba đã được chuyển thể thành một series anime được trình chiếu hơn 50 kỳ, và bao gồm những chuyến phiêu lưu mạo hiểm mà Yaiba đã trải qua trong vài tập đầu tiên trong truyện tranh. Câu chuyện bắt đầu khi Yaiba tập luyện để trở thành một samurai trong khu rừng già với cha và hai người bạn động vật, Kagetora and Shonosuke. Khi đến thời điểm thích hợp, cha của Yaiba thông báo rằng cậu đã sẵn sàng trở lại Nhật Bản và hướng dẫn cậu tìm một người bạn cũ và đồng thời cũng là đối thủ cạnh tranh của ông, đó là cha của Sayaka....', 'Đang cập nhập', '2004', 148065, 'HD', '26', 5, 9, 0, 'https://m.media-amazon.com/images/M/MV5BYzE3ODEzZjItMjhmMC00NjdkLWEyMTUtZmRiMzU3ZjBhODEwXkEyXkFqcGdeQXVyNjExODE1MDc@.jpg', '', 52, '52', ' THỨ 4 HÀNG TUẦN'),
(22, 'DRAGON BALL KAI 2014', 'DRAGON BALL KAI 2014', 'full', 1, 'Phần này là phần tiếp theo series Bi Rồng Nhiệm Màu “Kai” 98 tập trước.Đây là bản rmk, không như bản cũ (chỉ dừng lại ở trận cha con nhà Gohan và đồng đội đánh với Cell), bản này có thay đổi và thêm bớt về đồ họa cũng như nội dung. ', 'Đang cập nhập', '2004', 148065, 'HD', '26', 5, 9, 0, 'https://i.pinimg.com/474x/81/fd/21/81fd21a85c752b951b141446ee047077--anime-info-dragon-ball-gt.jpg', '', 61, '61', ' THỨ 4 HÀNG TUẦN'),
(23, 'SOLA', 'SOLA', 'full', 1, 'Morimiya Yorito là một học sinh thường cúp học vì mải mê ngắm nhìn và chụp hình bầu trời. Một ngày nọ, cậu thức dậy lúc bốn giờ sáng với hi vọng chụp được một cảnh bình minh rực rỡ. Và tình cờ, cậu gặp một cô gái bí ẩn tên là Shihou Matsuri. Cô có thân phận là một Yaka và có liên quan đến Yorito trong quá khứ. Những chuyện kì lạ, những tình huống nghiệt ngã do số phận sắp đặt liên tiếp xảy ra. Đó là chìa khóa dẫn tới thân phận thật sự của Yorito...', 'Đang cập nhập', '2004', 148065, 'HD', '26', 5, 9, 0, 'https://m.media-amazon.com/images/M/MV5BZDM1NmZkNGQtZjI5ZS00NGQxLTg4ZGMtNTMwN2FjY2QwYTc1XkEyXkFqcGdeQXVyMzEzMzczMDg@._V1_.jpg', '', 15, '15', ' THỨ 4 HÀNG TUẦN'),
(24, 'FATE STAY NIGHT', 'FATE STAY NIGHT', 'full', 1, 'Fate Stay Night nói về câu chuyện \"Cuộc Chiến Dành Chén Thánh\" của các \"Servant\" và chỉ có các \"Servant\" mới có thể chạm vào Chén Thánh, Các \"Servant\" là những vị anh hùng trong truyền thuyết và được triệu hồi từ 7 \"Master\", họ tranh dành vì Chén Thánh, vì Chén Thánh sẽ biến điều ước của họ thành sự thật....', 'Đang cập nhập', '2004', 148065, 'HD', '26', 5, 9, 0, 'https://static.wikia.nocookie.net/typemoon/images/7/71/Fate_stay_night_2006_Poster.jpg/revision/latest?cb=20191023111955&path-prefix=vi', '', 24, '24', ' THỨ 4 HÀNG TUẦN'),
(25, 'DRAGON BALL Z: BATTLE OF GODS', 'DRAGON BALL Z: BATTLE OF GODS', 'full', 1, 'Vài năm sau cuộc chiến đánh bại Ma Bư (Majin-Buu). Bills- vị thần hủy diệt duy trì trạng thái cân bằng cho vũ trụ đã thức dậy sau 1 giấc ngủ dài. Nghe tin có 1 Saiyan đã đánh bại Fide (Frieza), Bills lập tức đi tìm Goku.Sau 1 thời gian dài không có đối thủ , Goku bỏ qua lời khuyên của Thần Vũ Trụ (King Kai) và thách thức Bills trong 1 trận chiến. Tuy nhiên Goku không đủ mạnh trước sức mạnh áp đảo của Bills và đã bị đánh bại. Bills bỏ đi sau khi thốt lên \"Có kẻ nào đó trên Trái Đất xứng đáng để tiêu diệt?\".Các nhân vật chính phải cùng nhau luyện tập để chiến đấu trước khi bị tiêu diệt', 'Đang cập nhập', '2004', 148065, 'HD', '26', 5, 9, 0, 'https://static.wikia.nocookie.net/dragonball/images/5/5b/BattleofGodsscan1.jpg/revision/latest?cb=20130315144242', '', 1, '1', ' THỨ 4 HÀNG TUẦN'),
(26, 'DRAGON BALL Z ', 'DRAGON BALL Z ', 'full', 1, 'Với sự kết thúc của phần Dragon Ball, công ty Toei Animation nhanh chóng cho xuất bản loạt phim hoạt hình thứ 2 mang tên Dragon Ball Z (ドラゴンボールZ(ゼット), Doragon Bōru Zetto. Bắt đầu với phần tóm tắt nội dung phần trước, Dragon Ball Z có cốt truyện phù hợp với phần Dragon Ball từ tập 26. Dragon Ball Z được phát hành trên đài truyền hình Fuji vào 26 tháng 3 năm 1989.', 'Đang cập nhập', '2004', 148065, 'HD', '26', 5, 9, 0, 'https://gamek.mediacdn.vn/133514250583805952/2021/2/5/55c38e47dd089562258b461e-16124966158451271654681.jpg', '', 291, '291', ' THỨ 4 HÀNG TUẦN'),
(27, 'DRAGON BALL GT', 'DRAGON BALL GT', 'full', 1, 'Theo nguyên tác 7 viên ngọc rồng ( Dragon Ball ) thì sau khi tiêu diệt MABƯ ốm, nhóm bạn Sôn Gôku đã quay về trái đất và sống 1 cuộc sống yên bình. Tại kì thi võ thuật quốc tế năm đó, Sôn Gôku và nhóm bạn đã hội ngộ với MABƯ ốm dưới hình thức đầu thai là 1 chú bé nhà quê với tên ƯB Còm. Sôn Gôku đã nhận chú bé làm đệ tử và đưa chú lên thiên đình để huấn luyện thành 1 chiến sĩ trừ gian diệt bạo. Đây là phần tiếp theo của bộ Dragon', 'Đang cập nhập', '2004', 148065, 'HD', '26', 5, 9, 0, 'https://i.ytimg.com/vi/o72za80Vw_0/mqdefault.jpg', '', 64, '64', ' THỨ 4 HÀNG TUẦN'),
(28, 'DRAGON BALL KAI', 'DRAGON BALL KAI', 'full', 1, 'Dragon ball Kai bắt đầu từ sự xâm lăng của những người Saiyan. Phiên bản này sẽ được chỉnh sửa lại cho thật khớp với tác phẩm gốc của Akira Toriyama, do đó, câu chuyện sẽ tiến triển nhanh hơn! – Bài hát mở đầu và kết thúc sẽ được làm mới lại hoàn toàn!! Hơn nữa, trong \"Kai\", nền nhạc mới sẽ được thu âm lại. Hãy cùng nhau thưởng thức \"Kai\", nơi mà âm nhạc đã được hỗ trợ ở mức rất cao!! - Thông qua xử lý kỹ thuật số, hình ảnh sẽ trở nên vô cùng sinh động!! – Mọi bụi bẩn, lỗi hư hại và tiếng ồn trên \"Z\" sẽ được loại bỏ! Trong HD, hình ảnh sẽ trở nên rõ nét. Chúng tôi đã cẩn thận tạo ra một thế giới \"Kai\" cực kì hùng mạnh và ấn tượng đến từng chi tiết! – Giọng nói của những nhân vật sẽ một lần nữa được ghi lại!! – những diễn viên chính lồng tiếng trước đây, như Masako Nozawa - Son Goku, sẽ lại hợp nhất. Họ sẽ truyền hơi thở cuộc sống vào trong những nhân vật một lần nữa, như để chứng minh sự hấp dẫn của mình!!”', 'Đang cập nhập', '2004', 148065, 'HD', '26', 5, 9, 0, 'https://www.themoviedb.org/t/p/w600_and_h900_bestv2/ykl67ghR2ug6KGFH3CQcI01pzQJ.jpg', '', 98, '98', ' THỨ 4 HÀNG TUẦN'),
(29, 'DRAGON BALL Z MOVIE + OVA', 'DRAGON BALL Z MOVIE + OVA', 'full', 1, 'Câu chuyện bắt đầu với SonGoku, một cậu bé có đuôi sống với ông nội trong một ngôi nhà nhỏ trong rừng. Ở đây cậu bé gặp Bulma. Bulma được chứng kiến sức mạnh của SonGoku và muốn cùng cô lên đường tìm 7 viên ngọc rồng. Bảy viên ngọc rồng chứa đựng một bí mật có thể triệu hồi Long thần và ban điều ước cho ai sở hữu chúng.Trên cuộc hành trình dài đi tìm bảy viên ngọc rồng, họ gặp những người bạn và những đấu sĩ huyền thoại cũng như nhiều ác quỷ. Họ trải qua những khó khăn và học hỏi các chiêu thức võ thuật đặc biệt để tham gia thi đấu trong đại hội võ thuật thế giới được tổ chức hằng năm. Ngoài các sự kiện đại hội võ thuật, Goku và các bạn còn phải đối phó với các thế lực độc ác như Đại vương Pilaf, Quân đoàn khăn đỏ, Đại ma vương Piccolo và những đứa con của hắn', 'Đang cập nhập', '2004', 148065, 'HD', '26', 5, 9, 0, 'https://lh3.googleusercontent.com/-pDbsYAcvut8/XxUkIKz8iOI/AAAAAAAACcg/1kgKL0n6ZOsC3Urn8VpEZ32BmfXEiRaNQCNcBGAsYHQ/s0/Anivn.top_bay-vien-ngoc-rong-vong-dau-bat-phan.jpg', '', 14, '14', ' THỨ 4 HÀNG TUẦN'),
(30, 'DRAGON BALL', 'DRAGON BALL', 'full', 1, 'Mở đầu phim Dragon Ball (7 Viên Ngọc Rồng) một cậu bé có đuôi khỉ tên là Goku được tìm thấy bởi một ông lão sống một mình trong rừng, ông lão xem đứa bé như là cháu của mình. Một ngày nọ Goku tình cờ gặp một cô gái tên là Bulma trên đường đi bắt cá về, Goku và Bulma đã cùng nhau truy tìm bảy viên ngọc rồng. Bảy viên ngọc rồng chứa đựng một bí mật có thể triệu hồi một con rồng và ban điều ước cho ai sở hữu chúng. Trên cuộc hành trình dài đi tìm bảy viên ngọc rồng, họ gặp những người bạn và những đấu sĩ huyền thoại cũng như nhiều ác quỷ. Họ trải qua những khó khăn và học hỏi các chiêu thức võ thuật đặc biệt để tham gia thi đấu trong đại hội võ thuật thế giới được tổ chức hằng năm', 'Đang cập nhập', '2004', 148065, 'HD', '26', 5, 9, 0, 'https://upload.wikimedia.org/wikipedia/vi/4/4f/Dragon_Ball_Super_artwork.jpg', '', 153, '153', ' THỨ 4 HÀNG TUẦN'),
(31, 'NARUTO DATTEBAYO', 'NARUTO DATTEBAYO', 'full', 1, ' là bộ phim kể về chàng trai Naruto một chàng trai bướng bỉnh , nghịch ngợm và hậu đậu với mong muốn trở thành Hokage một vị lãnh tụ vĩ đại của làng Lá.\n\nCâu chuyện bắt đầu từ 12 năm trước một con hồ ly (cáo chín đuôi) bị điều khiển và tấn công làng ninja Mộc Diệp, Hokage Đệ Tứ đánh bại được con hồ ly và tiến hành phong ấn vào người của Naruto, lúc đó Naruto chỉ mới vừa được sinh ra. Kể từ đó Naruto bị mọi người trong làng xa lánh vì sợ làm nguy hại đến làng. Khi lớn bắt đầu cảm nhận và nhận thức được sự xa lánh của mọi người từ đó cậu bắt đầu phá phách , nghịch ngợm tìm mọi cách để mọi người chú ý và chứng minh về thực lực của mình. Câu chuyện bám sát theo quá trình trưởng thành của cậu bé, nhấn mạnh mối quan hệ giữa các Ninja và sự gắn kết không ngừng, từ phần này qua phần khác. Cuộc đời Naruto thay đổi khi bắt đầu gia nhập và tốt nghiệp học viện Ninja Naruto đã tìm được hai người bạn đồng hành và theo suốt quá trình theo đuổi ước mơ của mình đó là Uchiha Sasuke và Haruno Sakura. Trong suốt quá trình tác chiến cậu luôn theo đuổi ước và hoài bão của thầy Iruka từ lúc đó đã mở ra một cánh cửa mới dẫn đến sự hiện diện của hàng loạt các nhân vật lừng danh. Sự thay đổi, định nghĩa lại một thế giới yên bình không chiến tranh. Không thù hận.\n\nVuiGhe.Net luôn cập nhật các bộ phim Naruto Vietsub mới nhất chúng tôi luôn gắn bó và theo dõi từng câu chuyện cập nhật liên tục từng bộ phim. Phim Naruto Vietsub được chia làm 2 Phần.\n\nPhần 1: Mang tên Naruto Dattebayo, gồm 220 tập bộ phim kể về cậu về quá trình lớn lên và cuộc đời của cậu bé những nguy hiểm mà cậu đã gặp phải kèm theo đó là một động lực và niềm tin phi thường , một tâm hồn trong sáng chứa đựng những trò nghịch ngợm bướng bỉnh nhưng đầy hồn nhiên . Cùng với việc xoay quanh những người đã bỏ mạng do tranh giành quyền lực cộng với sự đau thương , mất mát mà Naruto đã trải qua.\n\nPhần 2: Mang tên Naruto Shippuuden, gồm hơn 600 tập kể về những thay đổi và sự trưởng thành của Naruto tất cả mọi thứ đã ra đi chỉ còn duy nhất một mình cậu với cuộc phưu lưu đầy mạo hiểm, câu chuyện xoay quanh cuộc đời của Naruto, Sasuke, Sakura sau đó là biến cố của nhân loại sự thay đổi lớn làm lịch sử Ninja thay đổi. Sóng gió dù sao cũng qua đi cậu về đến ngôi làng Lá của mình, cậu đã được thầy Iruka hướng dẫn và tập luyện, Tuy bướng bỉnh , nghịch ngợm có thể nói là kém thông minh nhưng bù lại là sự cố gắng không ngừng tất cả các tuyệt kỹ của thầy Iruka cậu đều học được, Cuối câu chuyện là sự hiện diện bất ngờ và bí ẩn của Akatsuki luôn rập rình và nguy hiểm , những pha phiêu lưu táo bạo và đầy kịch tính, những cuộc phiêu lưu mạo hiểm của Naruto trên Naruto Vietsub sẽ diễn ra như thế nào đây . Mời các bạn đón xem phần 1 của bộ phim trên trang http://vuighe.net/naruto-dattebayo . Đừng quên like và share để ủng hộ nhóm dịch nhé.', 'Đang cập nhập', '2004', 148065, 'HD', '26', 5, 9, 0, 'https://1.bp.blogspot.com/-KCFDoDb1VsY/X6_PgdLlXJI/AAAAAAAAA20/01PrupFtv3ohZvgqxYbzGJojJFOd3FJtQCLcBGAsYHQ/w680/Naruto.jpg', '', 220, '220', ' THỨ 4 HÀNG TUẦN'),
(32, 'BRAVE 10', 'BRAVE 10', 'full', 1, '', 'Đang cập nhập', '2004', 148065, 'HD', '26', 5, 9, 0, 'https://animeweb.xyz/wp-content/uploads/2021/09/Thap-Dai-Anh-Hung-Brave-10.jpg', '', 12, '12', ' THỨ 4 HÀNG TUẦN'),
(33, 'DRAGON BALL SUPER: BROLY', 'DRAGON BALL SUPER: BROLY', 'full', 2, 'Chủ đề cho movie mới này sẽ là về \"Saiyan\", cuộc ganh đua để dành được dành được danh hiệu bá chủ vũ trụ. Kể từ sau \"Battle of Gods\" Goku đã có được nhiều sức mạnh từ Super Saiyan God đến Super Saiyan Blue, và thêm nhiều cấp độ mới trong trận đấu chống lại những kẻ mạnh đến từ những vũ trụ khác. Câu truyện mới lần này sẽ tập trung vào nguồn gốc sức mạnh của người Saiyan và hiểu Saiyan là gì.', ' Nagamine Tatsuya', '2018', 1277106, 'HD', '115', 5, 9, 0, 'https://s199.imacdn.com/vg/2018/07/25/2ea87af8688597d8_1d234d74b07c34be_4555615325311272118684.jpg', '', 1, '1', ' THỨ 4 HÀNG TUẦN'),
(34, 'PEACE MAKER KUROGANE', 'PEACE MAKER KUROGANE', 'full', 2, 'Vào mùa xuân năm 1863, cậu thiếu niên Tetsunosuke Ichimura (gọi tắt là Tetsu-kun) 15 tuổi, cầm bảng tuyển mộ chạy tới nơi ở của Shinsengumi (nhóm Tân Tuyển) để xin gia nhập, bất chấp sự ngăn cản của anh trai là Tatsunosuke. Nhưng các binh sĩ gác cổng lại chê cậu… lùn quá (hay nói cách khác là giống con nít) nên không cho gia nhập và đuổi đi. Sau đó thế nào thì xem rồi sẽ biết.', '', '2001', 45763, 'HD', '24', 5, 9, 0, 'https://s199.imacdn.com/vg/2018/02/15/ea96a388093baa1c_7af9adefdc462c6f_149686151868681229674.jpg', '', 24, '24', ' THỨ 4 HÀNG TUẦN'),
(35, 'SENGOKU NIGHT BLOOD', 'SENGOKU NIGHT BLOOD', 'full', 2, 'Một hôm, Yuzuki bị bao phủ bởi tia sáng bí ẩn phát ra từ điện thoại của cô và thấy mình ở một nơi lạ.Phong cảnh trước mắt cô giống như thời Sengoku (Chiến quốc) Nhật bản. Nhưng đây là thế giới khác được gọi là \"Shinga\", nơi mà các sinh vật không phải con người như ma cà rồng và người sói cư trú.\nToyotomi Hideyoshi, người lãnh đạo quân Toyotomi, mang Yuzuki đi theo sau khi giải cứu cô trên chiến trường và vô tình phát hiện máu của cô có thể đánh thức sức mạnh tiềm ẩn của Tộc Gegga. \nSau khi biết được sức mạnh của máu Yuzuki, các lãnh chúa khác như Oda, Uesugi, Takeda, Sanada và Date bắt đầu theo đuổi Yuzuki, mỗi người đều có mục đích riêng.', 'Nanae_Chrono', '2017', 247838, 'HD', '24', 5, 9, 0, 'https://s199.imacdn.com/vg/2017/09/28/dbdf8e94d3a09983_6a1cabf6de9af64c_32827150659577159674.jpg', '', 12, '12', ' THỨ 4 HÀNG TUẦN'),
(36, 'KAZEMAKASE TSUKIKAGE RAN', 'KAZEMAKASE TSUKIKAGE RAN', 'full', 2, 'Tsukikage Ran- một nữ ronin có tình yêu vô cùng mãnh liệt với rượu sake. Myao- một nữ du khách vui tính, vô tư, có tuyệt chiêu Mêu Thiết Quyền. Sau 1 cuộc gặp gỡ, 2 con người đó trở thành bạn đồng hành thân thiết, cùng nhau trải qua các cuộc phiêu lưu, đánh bại kẻ xấu, giúp đỡ người lành (1 cách tình cờ hay cố ý) trên nền bối cảnh Edo, Nhật Bản', 'Đang cập nhập', '2000', 16531, 'HD', '24', 5, 9, 0, 'https://s199.imacdn.com/vg/2017/09/28/c75c3f767214a7ad_599dcee04b9f044e_29798150658334899674.jpg', '', 13, '13', ' THỨ 4 HÀNG TUẦN'),
(37, 'THE KING OF FIGHTERS: DESTINY', 'THE KING OF FIGHTERS: DESTINY', 'Đang phát hành', 2, 'Là phiên bản Anime CG dài tập được phát sóng để PR cho tựa game mobile The King of Fighters: World vừa được ra mắt tại Trung Quốc.\n\n\n\nGame King of Fighters gốc là do hãng game Nhật SNK phát hành từ năm 1994 trên máy arcade.\n\nNhưng sau một thời gian xưng bá làng game thì SNK ko thể cạnh tranh với các công nghệ hiện đại đến từ hãng game khác và thế là thua lỗ, nợ nần rồi phá sản . May sao anh Trung Quốc, anh rất cuồng game trên máy arcade  và nhất là cái King of Fighters nên đã mua lại SNK cho nên việc sản xuất phim chuyển thể bởi Trung Quốc cũng là điều dễ hiểu.\n\nCũng may là nhờ Trung Quốc dang tay nên mới có phim mà coi, không thì chờ đến mùa quýt mấy anh Nhật cũng ko làm đâu.\nTức phim này Nhật lai Trung.', 'Đang cập nhập', 'Đang cập nhập', 133077, 'HD', '20', 5, 9, 0, 'https://s199.imacdn.com/vg/2017/08/14/97687af82e6a6542_adc58a6120e2396a_13565715026868172185710.jpg', '', 13, '24', ' THỨ 4 HÀNG TUẦN'),
(38, 'SENGOKU BASARA MOVIE: THE LAST PARTY', 'SENGOKU BASARA MOVIE: THE LAST PARTY', 'full', 2, 'Kể về diễn biến tiếp theo sau phần 2 series Anime cùng tên (link này), chủ yếu là về trận chiến cuối cùng tại Sekigahara để quyết định người dành quyền thống nhất Nhật Bản.', 'Đang cập nhập', '2011', 19865, 'HD', '93', 5, 9, 0, 'https://s199.imacdn.com/vg/2016/11/10/f98de52e350e32c4_574c74820f9f9ee2_35853147875424159674.jpg', '', 1, '1', ' THỨ 4 HÀNG TUẦN'),
(39, 'SOUL BUSTER', 'SOUL BUSTER', 'full', 2, 'Tại Kinh Châu, Trung Quốc.\nMột cuốn sách lịch sử ghi chép về thời đại Tam Quốc viết rằng, nơi đây đã từng là một vùng đất chiến tranh bất tận.\nMột nam sinh Cao Trung tên Tôn Thần, vốn ghét lịch sử về nơi mà cậu sinh sống, đã gặp vài vấn đề về 1 giấc mơ nhất định.\nSau khi tỉnh giấc khỏi giấc mơ, những việc lạ lùng lần lượt diễn ra, khi chưa kịp nắm bắt vấn đề, thì cậu đột nhiên đã phải đối mặt với Diên (Ngụy Diên), một trong những vị tưởng từ thời Tam Quốc, người đang có ý định giết cậu ta!\nNgay trước khi Diên vung thanh đại đao của mình xuống, một mỹ nhân kỳ bí đã xuất hiện trước mặt Tôn Thần.\nThử thách gì đang đón chờ Tôn Thần, khi cậu phải chứng kiến một trận đánh kinh hoàng giữa 2 vị tướng từ thời Tam Quốc?!', 'Đang cập nhập', '2016', 147382, 'HD', '14', 5, 9, 0, 'https://s199.imacdn.com/vg/2016/10/11/cf7a7827928401a6_fc53a8260446babb_28941147619720879674.jpg', '', 12, '12', ' THỨ 4 HÀNG TUẦN'),
(40, 'BLEACH MOVIE', 'BLEACH MOVIE', 'full', 2, 'Cuộc sống vẫn diễn ra bình lặng ở thành phố Kurakura trên nhân giới cho đến một ngày Ichigo, một Shinigami thế thân, và Rukia_một Shinigami thuộc đội 12 đang hoạt động trên Nhân giới phát hiện ra một nguồn Reiaku kì lạ. Khi họ đến nơi phát ra nguồn Reiaku đó, họ gặp những sinh vật kì lạ đội nũ pixy đỏ. Và một Shinigami bí ấn xuất hiện dọn sạch những sinh vật kì lạ đó đi. Cùng lúc đó dưới Tâm Linh Giới đang nhốn nháo vì một không gian lạ đang dần mở rộng và có nguy cơ sẽ khiến Tâm Linh GIới và Nhân Giới hòa làm một. Nếu chuyện đó xảy ra, kết quả sẽ thế nào đây?', 'Noriyuki Abe', '2006', 198114, 'HD', '133', 5, 9, 0, 'https://s199.imacdn.com/vg/2015/05/bleach-movie-large-1432285084.jpg', '', 4, '4', ' THỨ 4 HÀNG TUẦN'),
(41, 'SAMURAI 7', 'SAMURAI 7', 'full', 2, 'Câu chuyện diễn ra tại một thế giới rất kì lạ, nơi thanh kiếm đi đôi với những vũ khí tối tân.Trong thế giới ấy, Nhật Bản đã xảy ra cuộc chiến giữa các samurai cơ khí (nghĩa là cơ thể của họ không còn da thịt nữa mà đã biến thành sắt thép nhờ công nghệ hiện đại). Sau mấy chục năm nội chiến dai dẳng, cuối cùng cũng đi tới hòa bình. Nhưng thực ra các samurai bại trận vẫn ngấm ngầm ôm ý muốn phục thù. Nền hòa bình ngắn ngủi bị lung lay nghiêm trọng.', ' Toshifumi Takizawa', '2004', 148065, 'HD', '26', 5, 9, 0, 'https://s199.imacdn.com/vg/2015/05/samurai-7-large-1432285082.jpg', '', 26, '26', ' THỨ 4 HÀNG TUẦN'),
(42, 'Sengoku Musou', 'Sengoku Musou', 'full', 2, 'Được chuyển thể từ game cùng tên “Sengoku Musou” ,Cốt truyện phim kể về 2 nhân vật “Toyotomi và Tokugawa”. Nói về Toyotomi Hideyoshi đang trên bờ vực của việc thống nhất vương quốc, và tất cả những gì còn lại là Lâu đài Odawara bảo vệ bởi các \"Lion của Sagami\" Ujiyasu Houjou. Tướng-Ishida đào tạo cá nhân của Hideyoshi Mitsunari, Katou Kiyomasa và Masanori Fukushima-cũng như Ootani Yoshitsugu, Shima Sakon, và Naoe Kanetsugu là tất cả trên tuyến đầu của cuộc chiến. Giữa cuộc chiến đấu là hai chiến binh trẻ tuổi thuộc gia đình Sanada: Anh trai và em trai Nobuyuki Yukimura. Khi bế tắc bắt đầu bị phá vỡ, Sanada Yukimura cưỡi trên một con ngựa duy nhất vào cuộc chiến và cuộc chiến lại bắt đầu...', 'Đang cập nhập', '2004', 148065, 'HD', '26', 5, 9, 0, 'https://s199.imacdn.com/vg/2015/05/sengoku-musou-large-1432285081.jpg', '', 12, '12', ' THỨ 4 HÀNG TUẦN'),
(43, 'THIÊN KHÔNG CHIẾN KÍ', 'TENKUU SENKI SHURATO ', 'full', 2, 'Cốt truyện xoay quanh hai huynh đệ kết nghĩa, Shurato Hidaka và Gai Kuroki, trái ngược nhau về ngoại hình và tính cách. Trong khi chiến đấu với nhau trong một giải đấu võ thuật, họ đột nhiên bị bọc trong một chùm ánh sáng và bị dịch chuyển đến một thế giới song song, Tenkūkai, nơi không tồn tại công nghệ hiện đại mà thay vào đó là những người dựa vào Sohma, một dạng năng lượng tinh thần.', 'Đang cập nhập', '2004', 148065, 'HD', '26', 5, 9, 0, 'https://s199.imacdn.com/vg/2015/05/thien-khong-chien-ki-tenkuu-senki-shurato-large-1432285074.jpg', '', 38, '38', ' THỨ 4 HÀNG TUẦN'),
(44, 'FATE STAY NIGHT - UNLIMITED BLADE WORKS', 'FATE STAY NIGHT - UNLIMITED BLADE WORKS', 'full', 2, 'Bản remake từ Movie Unlimited Blade Work. Trong series này, Tohsaka Rin sẽ là nhân vật nữ chính. Đồng thời cũng tiết lộ về Shirou và thiên mệnh cậu ấy sẽ phải gánh vác lên vai...Nhóm sub: Clip-sub', 'Đang cập nhập', '2004', 148065, 'HD', '26', 5, 9, 0, 'https://s199.imacdn.com/vg/2015/05/fate-stay-night-unlimited-blade-works-large-1432285067.jpg', '', 25, '25', ' THỨ 4 HÀNG TUẦN'),
(45, 'BLADE AND SOUL', 'BLADE AND SOUL', 'full', 2, 'Alka là một sát thủ trong dòng họ Kiếm sĩ. Cô ấy đang trên đường đi tìm một người phụ nữ tên là Jin Valel, người đã sát hại Kiếm sư Hon. Jin giống như một con quỷ đội lốt người với khả năng sử dụng Ô uế và giết người không chớp mắt.', 'Đang cập nhập', '2004', 148065, 'HD', '26', 5, 9, 0, 'https://s199.imacdn.com/vg/2015/05/blade-and-soul-large-1432285064.jpg', '', 13, '13', ' THỨ 4 HÀNG TUẦN'),
(46, 'HITOHIRA', 'HITOHIRA', 'full', 2, 'Asai Mugi vừa bước vào học viện Mĩ thuật Kumataka, cô bé gặp rắc rối trong việc nói chuyện mỗi khi có việc gì đó xảy đến làm cô bé hoảng sợ. Bị các senpai trong club hội Nghiên Cứu Kịch ép tham gia, cô bé đã dần dần thay đổi mình dưới sự tác động mạnh mẽ từ những thành viên trong club.', 'Đang cập nhập', '2004', 148065, 'HD', '26', 5, 9, 0, 'https://s199.imacdn.com/vg/2015/05/hitohira-large-1432285060.jpg', '', 12, '12', ' THỨ 4 HÀNG TUẦN'),
(47, 'HUNTER X HUNTER THE MOVIE 2 - THE LAST MISSION', 'HUNTER X HUNTER THE MOVIE 2 - THE LAST MISSION', 'full', 2, 'Các Hunter mạnh nhất của Hiệp Hội Hunter đã chia ra thành hai phần, \"bóng tối\" và \"ánh sáng\", và mỗi bên trong bọn họ tự đi trên con đường riêng của mình. \"Mặt tối\" dần dần trở thành một thế lực truy sát các Hunters. Sau một cuộc tấn công dữ dội của Hunter \"bóng tối\", Killia bị trọng thương và Kurapika gần như sắp chết đến nơi. Mục đích thật sự sau các vụ tấn công các Hunters là gì? Giờ đây, những tội ác của Netero và của Hiệp Hội đều được thông báo rộng rãi. Liệu rằng Gon có thể giải quyết được \"bóng tối\" kia và cứu rỗi lấy bạn bè của mình? Gon sẽ phản ứng ra sao khi biết được tội ác đằng sau Netero và Hiệp Hội Hunter...', 'Đang cập nhập', '2004', 148065, 'HD', '26', 5, 9, 0, 'https://s199.imacdn.com/vg/2015/05/hunter-x-hunter-the-movie-2-the-last-mission-large-1432285048.jpg', '', 1, '1', ' THỨ 4 HÀNG TUẦN'),
(48, 'AKAME GA KILL!', 'AKAME GA KILL!', 'full', 2, 'Câu chuyện Akame ga Kill xoay quanh Tatsumi, một thanh niên trẻ tuổi đầy nhiệt huyết.Vốn xuất thân từ nông thôn nhưng có chút ít năng lực võ nghệ, cậu lên thủ đô với mục đích kiếm tiền gầy dựng lại ngôi làng của mình. Chỉ để rồi khám phá ra cái xã hội mục nát đang ăn sâu vào con người và đất nước, ẩn chứa qua vẻ đẹp hào nhoáng của chốn phồn hoa đô thị. Trong hoàn cảnh bế tắc của Akame ga Kill, làm cậu mất định hướng cho tương lai, thì một nhóm sát thủ với tên gọi “Night Raid” có lời mời kết nạp. Và cuộc chiến chống lại đế chế thối nát nhằm mang đến công lý bên cạnh những người bạn sát thủ diễn ra trong Akame ga Kill', 'Đang cập nhập', '2004', 148065, 'HD', '26', 5, 9, 0, 'https://s199.imacdn.com/vg/2015/05/akame-ga-kill-large-1432285039.jpg', '', 24, '24', ' THỨ 4 HÀNG TUẦN'),
(49, 'SWORD ART ONLINE II - GUN GALE ONLINE', 'SWORD ART ONLINE II - GUN GALE ONLINE', 'full', 2, 'Đã một năm kể từ khi  được Sword Art Online II clear, Kikouta đã đề nghị Kirito khám phá Gun Gale Online, hay cụ thể hơn là Death Gun - một vũ khí có khả năng liên kết cái chết từ trong thế giới ảo ra ngoài thế giới thực. \nKhi vào Game, Sinon đã chỉ dạy cho Kirito các ràng buộc của SAO - GGO. Sau đó cả hai cùng tham gia đại hội Gun Gale Online, Bullet of Bullets. Mặc dù chỉ là Newbie nhưng Kirito đã thể hiện được các kỹ năng rất cao cường. Cậu đã điều tra những cái chết kỳ lạ có liên quan tới một Xích Hội tên là Laughing Coffin ở trong Sword Art Online II .', 'Đang cập nhập', '2004', 148065, 'HD', '26', 5, 9, 0, 'https://s199.imacdn.com/vg/2015/05/sword-art-online-ii-gun-gale-online-large-1432285039.jpg', '', 24, '24', ' THỨ 4 HÀNG TUẦN'),
(50, 'NARUTO SD ', 'NARUTO SD ', 'full', 2, 'Rock Lee và con đường Ninja là một series Anime Naruto lấy nhân vật chính là Rock Lee, các nhân vật được Chibi hóa tới mức đáng yêu, ngộ nghĩnh. Bộ phim Naruto Vietsub được vẽ bởi Kenji Taira - một trợ lý của Mashashi Kishimoto (tác giả Naruto) và được đạo diễn bởi Masahiko Murata..', 'Đang cập nhập', '2004', 148065, 'HD', '26', 5, 9, 0, 'https://s199.imacdn.com/vg/2015/05/naruto-sd-large-1432285036.jpg', '', 51, '51', ' THỨ 4 HÀNG TUẦN'),
(51, 'KATANAGATARI', 'KATANAGATARI', 'full', 2, 'Thợ rèn kiếm huyền thoại Shikizaki Kiki đã rèn ra 1000 thanh kiếm trong sự nghiệp của ông. Người nào thâu tóm càng nhiều kiếm trong tay, khả năng chiến thắng của người đó sẽ càng cao. Khi Mạc phủ chiến thắng, họ đã thu về được 988 thanh kiếm... nhưng thực tế, chúng chỉ là những thanh kiếm thử nghiệm. 12 thanh cuối cùng mới thật sự là bảo kiếm. Mỗi thanh đều ẩn chứa trong mình một quyền năng phi thường, mang lại cho chủ nhân của nó sức mạnh có thể địch lại cả một quân đội. Mạc phủ đã tức tốc phái chiến lược gia Togame lên đường tìm 12 thanh bảo kiếm đó. Sau khi thuê một ninja và bị hắn phản bội, thuê một kiếm sĩ và lại bị cướp mất bảo kiếm, cô đã phải tìm đến hi vọng cuối cùng: Vô kiếm phái. Kiếm phái từng xưng bá thời chiến quốc, một kiếm phái... không dùng kiếm.', 'Đang cập nhập', '2004', 148065, 'HD', '26', 5, 9, 0, 'https://s199.imacdn.com/vg/2015/05/katanagatari-large-1432285034.jpg', '', 12, '12', ' THỨ 4 HÀNG TUẦN'),
(52, 'CHROME SHELLED REGIOS', 'CHROME SHELLED REGIOS', 'full', 2, 'Phim dành cho đối tượng trên 16 tuổi. Dựa trên light novel cùng tên. Câu chuyện diễn ra trong tương lai, khi thế giới đang bị những sinh vật làm ô nhiễm “pollutant” đẩy loài người vào một thành phố di động mang tên Regios. Lei-Fon Alseif, một học sinh năm 1 phổ thông, đã miễn cưỡng tham gia vào đơn vị nghiên cứu võ thuật 17 do một sinh viên năm cuối Nina Antouku dẫn đầu chống lại những “Pollutant Beasts”.', 'Đang cập nhập', '2004', 148065, 'HD', '26', 5, 9, 0, 'https://s199.imacdn.com/vg/2015/05/chrome-shelled-regios-large-1432285032.jpg', '', 24, '24', ' THỨ 4 HÀNG TUẦN'),
(53, 'KENYUU DENSETSU YAIBA', 'KENYUU DENSETSU YAIBA', 'full', 2, 'Yaiba đã được chuyển thể thành một series anime được trình chiếu hơn 50 kỳ, và bao gồm những chuyến phiêu lưu mạo hiểm mà Yaiba đã trải qua trong vài tập đầu tiên trong truyện tranh. Câu chuyện bắt đầu khi Yaiba tập luyện để trở thành một samurai trong khu rừng già với cha và hai người bạn động vật, Kagetora and Shonosuke. Khi đến thời điểm thích hợp, cha của Yaiba thông báo rằng cậu đã sẵn sàng trở lại Nhật Bản và hướng dẫn cậu tìm một người bạn cũ và đồng thời cũng là đối thủ cạnh tranh của ông, đó là cha của Sayaka....', 'Đang cập nhập', '2004', 148065, 'HD', '26', 5, 9, 0, 'https://s199.imacdn.com/vg/2015/05/kenyuu-densetsu-yaiba-large-1432285031.jpg', '', 52, '52', ' THỨ 4 HÀNG TUẦN'),
(54, 'DRAGON BALL KAI 2014', 'DRAGON BALL KAI 2014', 'full', 2, 'Phần này là phần tiếp theo series Bi Rồng Nhiệm Màu “Kai” 98 tập trước.Đây là bản rmk, không như bản cũ (chỉ dừng lại ở trận cha con nhà Gohan và đồng đội đánh với Cell), bản này có thay đổi và thêm bớt về đồ họa cũng như nội dung. ', 'Đang cập nhập', '2004', 148065, 'HD', '26', 5, 9, 0, 'https://s199.imacdn.com/vg/2015/05/dragon-ball-kai-2014-large-1432285033.jpg', '', 61, '61', ' THỨ 4 HÀNG TUẦN'),
(55, 'SOLA', 'SOLA', 'full', 2, 'Morimiya Yorito là một học sinh thường cúp học vì mải mê ngắm nhìn và chụp hình bầu trời. Một ngày nọ, cậu thức dậy lúc bốn giờ sáng với hi vọng chụp được một cảnh bình minh rực rỡ. Và tình cờ, cậu gặp một cô gái bí ẩn tên là Shihou Matsuri. Cô có thân phận là một Yaka và có liên quan đến Yorito trong quá khứ. Những chuyện kì lạ, những tình huống nghiệt ngã do số phận sắp đặt liên tiếp xảy ra. Đó là chìa khóa dẫn tới thân phận thật sự của Yorito...', 'Đang cập nhập', '2004', 148065, 'HD', '26', 5, 9, 0, 'https://s199.imacdn.com/vg/2015/05/sola-large-1432285028.jpg', '', 15, '15', ' THỨ 4 HÀNG TUẦN'),
(56, 'FATE STAY NIGHT', 'FATE STAY NIGHT', 'full', 2, 'Fate Stay Night nói về câu chuyện \"Cuộc Chiến Dành Chén Thánh\" của các \"Servant\" và chỉ có các \"Servant\" mới có thể chạm vào Chén Thánh, Các \"Servant\" là những vị anh hùng trong truyền thuyết và được triệu hồi từ 7 \"Master\", họ tranh dành vì Chén Thánh, vì Chén Thánh sẽ biến điều ước của họ thành sự thật....', 'Đang cập nhập', '2004', 148065, 'HD', '26', 5, 9, 0, 'https://s199.imacdn.com/vg/2015/05/fate-stay-night-large-1432285025.jpg', '', 24, '24', ' THỨ 4 HÀNG TUẦN'),
(57, 'DRAGON BALL Z: BATTLE OF GODS', 'DRAGON BALL Z: BATTLE OF GODS', 'full', 2, 'Vài năm sau cuộc chiến đánh bại Ma Bư (Majin-Buu). Bills- vị thần hủy diệt duy trì trạng thái cân bằng cho vũ trụ đã thức dậy sau 1 giấc ngủ dài. Nghe tin có 1 Saiyan đã đánh bại Fide (Frieza), Bills lập tức đi tìm Goku.Sau 1 thời gian dài không có đối thủ , Goku bỏ qua lời khuyên của Thần Vũ Trụ (King Kai) và thách thức Bills trong 1 trận chiến. Tuy nhiên Goku không đủ mạnh trước sức mạnh áp đảo của Bills và đã bị đánh bại. Bills bỏ đi sau khi thốt lên \"Có kẻ nào đó trên Trái Đất xứng đáng để tiêu diệt?\".Các nhân vật chính phải cùng nhau luyện tập để chiến đấu trước khi bị tiêu diệt', 'Đang cập nhập', '2004', 148065, 'HD', '26', 5, 9, 0, 'https://s199.imacdn.com/vg/2015/05/dragon-ball-z-battle-of-gods-large-1432285006.jpg', '', 1, '1', ' THỨ 4 HÀNG TUẦN'),
(58, 'DRAGON BALL Z ', 'DRAGON BALL Z ', 'full', 2, 'Với sự kết thúc của phần Dragon Ball, công ty Toei Animation nhanh chóng cho xuất bản loạt phim hoạt hình thứ 2 mang tên Dragon Ball Z (ドラゴンボールZ(ゼット), Doragon Bōru Zetto. Bắt đầu với phần tóm tắt nội dung phần trước, Dragon Ball Z có cốt truyện phù hợp với phần Dragon Ball từ tập 26. Dragon Ball Z được phát hành trên đài truyền hình Fuji vào 26 tháng 3 năm 1989.', 'Đang cập nhập', '2004', 148065, 'HD', '26', 5, 9, 0, 'https://s199.imacdn.com/vg/2015/05/dragon-ball-z-large-1432284979.jpg', '', 291, '291', ' THỨ 4 HÀNG TUẦN'),
(59, 'DRAGON BALL GT', 'DRAGON BALL GT', 'full', 2, 'Theo nguyên tác 7 viên ngọc rồng ( Dragon Ball ) thì sau khi tiêu diệt MABƯ ốm, nhóm bạn Sôn Gôku đã quay về trái đất và sống 1 cuộc sống yên bình. Tại kì thi võ thuật quốc tế năm đó, Sôn Gôku và nhóm bạn đã hội ngộ với MABƯ ốm dưới hình thức đầu thai là 1 chú bé nhà quê với tên ƯB Còm. Sôn Gôku đã nhận chú bé làm đệ tử và đưa chú lên thiên đình để huấn luyện thành 1 chiến sĩ trừ gian diệt bạo. Đây là phần tiếp theo của bộ Dragon', 'Đang cập nhập', '2004', 148065, 'HD', '26', 5, 9, 0, 'https://s199.imacdn.com/vg/2015/05/dragon-ball-gt-large-1432284979.jpg', '', 64, '64', ' THỨ 4 HÀNG TUẦN');
INSERT INTO `film` (`film_id`, `flim_name`, `film_name_real`, `film_trangthai`, `film_type`, `film_mota`, `film_tacgia`, `film_date_aired`, `film_views`, `film_quality`, `film_duration`, `film_rating`, `film_scores`, `flim_assessor`, `film_img`, `film_traller`, `film_current_episode`, `film_end_episode`, `film_showtimes`) VALUES
(60, 'DRAGON BALL KAI', 'DRAGON BALL KAI', 'full', 2, 'Dragon ball Kai bắt đầu từ sự xâm lăng của những người Saiyan. Phiên bản này sẽ được chỉnh sửa lại cho thật khớp với tác phẩm gốc của Akira Toriyama, do đó, câu chuyện sẽ tiến triển nhanh hơn! – Bài hát mở đầu và kết thúc sẽ được làm mới lại hoàn toàn!! Hơn nữa, trong \"Kai\", nền nhạc mới sẽ được thu âm lại. Hãy cùng nhau thưởng thức \"Kai\", nơi mà âm nhạc đã được hỗ trợ ở mức rất cao!! - Thông qua xử lý kỹ thuật số, hình ảnh sẽ trở nên vô cùng sinh động!! – Mọi bụi bẩn, lỗi hư hại và tiếng ồn trên \"Z\" sẽ được loại bỏ! Trong HD, hình ảnh sẽ trở nên rõ nét. Chúng tôi đã cẩn thận tạo ra một thế giới \"Kai\" cực kì hùng mạnh và ấn tượng đến từng chi tiết! – Giọng nói của những nhân vật sẽ một lần nữa được ghi lại!! – những diễn viên chính lồng tiếng trước đây, như Masako Nozawa - Son Goku, sẽ lại hợp nhất. Họ sẽ truyền hơi thở cuộc sống vào trong những nhân vật một lần nữa, như để chứng minh sự hấp dẫn của mình!!”', 'Đang cập nhập', '2004', 148065, 'HD', '26', 5, 9, 0, 'https://s199.imacdn.com/vg/2015/05/dragon-ball-kai-large-1432284979.jpg', '', 98, '98', ' THỨ 4 HÀNG TUẦN'),
(61, 'DRAGON BALL Z MOVIE + OVA', 'DRAGON BALL Z MOVIE + OVA', 'full', 2, 'Câu chuyện bắt đầu với SonGoku, một cậu bé có đuôi sống với ông nội trong một ngôi nhà nhỏ trong rừng. Ở đây cậu bé gặp Bulma. Bulma được chứng kiến sức mạnh của SonGoku và muốn cùng cô lên đường tìm 7 viên ngọc rồng. Bảy viên ngọc rồng chứa đựng một bí mật có thể triệu hồi Long thần và ban điều ước cho ai sở hữu chúng.Trên cuộc hành trình dài đi tìm bảy viên ngọc rồng, họ gặp những người bạn và những đấu sĩ huyền thoại cũng như nhiều ác quỷ. Họ trải qua những khó khăn và học hỏi các chiêu thức võ thuật đặc biệt để tham gia thi đấu trong đại hội võ thuật thế giới được tổ chức hằng năm. Ngoài các sự kiện đại hội võ thuật, Goku và các bạn còn phải đối phó với các thế lực độc ác như Đại vương Pilaf, Quân đoàn khăn đỏ, Đại ma vương Piccolo và những đứa con của hắn', 'Đang cập nhập', '2004', 148065, 'HD', '26', 5, 9, 0, 'https://s199.imacdn.com/vg/2015/05/dragon-ball-movie-1-13-large-1432284987.jpg', '', 14, '14', ' THỨ 4 HÀNG TUẦN'),
(62, 'DRAGON BALL', 'DRAGON BALL', 'full', 2, 'Mở đầu phim Dragon Ball (7 Viên Ngọc Rồng) một cậu bé có đuôi khỉ tên là Goku được tìm thấy bởi một ông lão sống một mình trong rừng, ông lão xem đứa bé như là cháu của mình. Một ngày nọ Goku tình cờ gặp một cô gái tên là Bulma trên đường đi bắt cá về, Goku và Bulma đã cùng nhau truy tìm bảy viên ngọc rồng. Bảy viên ngọc rồng chứa đựng một bí mật có thể triệu hồi một con rồng và ban điều ước cho ai sở hữu chúng. Trên cuộc hành trình dài đi tìm bảy viên ngọc rồng, họ gặp những người bạn và những đấu sĩ huyền thoại cũng như nhiều ác quỷ. Họ trải qua những khó khăn và học hỏi các chiêu thức võ thuật đặc biệt để tham gia thi đấu trong đại hội võ thuật thế giới được tổ chức hằng năm', 'Đang cập nhập', '2004', 148065, 'HD', '26', 5, 9, 0, 'https://s199.imacdn.com/vg/2015/05/dragon-ball-large-1432284978.jpg', '', 153, '153', ' THỨ 4 HÀNG TUẦN'),
(63, 'NARUTO DATTEBAYO', 'NARUTO DATTEBAYO', 'full', 2, ' là bộ phim kể về chàng trai Naruto một chàng trai bướng bỉnh , nghịch ngợm và hậu đậu với mong muốn trở thành Hokage một vị lãnh tụ vĩ đại của làng Lá.\n\nCâu chuyện bắt đầu từ 12 năm trước một con hồ ly (cáo chín đuôi) bị điều khiển và tấn công làng ninja Mộc Diệp, Hokage Đệ Tứ đánh bại được con hồ ly và tiến hành phong ấn vào người của Naruto, lúc đó Naruto chỉ mới vừa được sinh ra. Kể từ đó Naruto bị mọi người trong làng xa lánh vì sợ làm nguy hại đến làng. Khi lớn bắt đầu cảm nhận và nhận thức được sự xa lánh của mọi người từ đó cậu bắt đầu phá phách , nghịch ngợm tìm mọi cách để mọi người chú ý và chứng minh về thực lực của mình. Câu chuyện bám sát theo quá trình trưởng thành của cậu bé, nhấn mạnh mối quan hệ giữa các Ninja và sự gắn kết không ngừng, từ phần này qua phần khác. Cuộc đời Naruto thay đổi khi bắt đầu gia nhập và tốt nghiệp học viện Ninja Naruto đã tìm được hai người bạn đồng hành và theo suốt quá trình theo đuổi ước mơ của mình đó là Uchiha Sasuke và Haruno Sakura. Trong suốt quá trình tác chiến cậu luôn theo đuổi ước và hoài bão của thầy Iruka từ lúc đó đã mở ra một cánh cửa mới dẫn đến sự hiện diện của hàng loạt các nhân vật lừng danh. Sự thay đổi, định nghĩa lại một thế giới yên bình không chiến tranh. Không thù hận.\n\nVuiGhe.Net luôn cập nhật các bộ phim Naruto Vietsub mới nhất chúng tôi luôn gắn bó và theo dõi từng câu chuyện cập nhật liên tục từng bộ phim. Phim Naruto Vietsub được chia làm 2 Phần.\n\nPhần 1: Mang tên Naruto Dattebayo, gồm 220 tập bộ phim kể về cậu về quá trình lớn lên và cuộc đời của cậu bé những nguy hiểm mà cậu đã gặp phải kèm theo đó là một động lực và niềm tin phi thường , một tâm hồn trong sáng chứa đựng những trò nghịch ngợm bướng bỉnh nhưng đầy hồn nhiên . Cùng với việc xoay quanh những người đã bỏ mạng do tranh giành quyền lực cộng với sự đau thương , mất mát mà Naruto đã trải qua.\n\nPhần 2: Mang tên Naruto Shippuuden, gồm hơn 600 tập kể về những thay đổi và sự trưởng thành của Naruto tất cả mọi thứ đã ra đi chỉ còn duy nhất một mình cậu với cuộc phưu lưu đầy mạo hiểm, câu chuyện xoay quanh cuộc đời của Naruto, Sasuke, Sakura sau đó là biến cố của nhân loại sự thay đổi lớn làm lịch sử Ninja thay đổi. Sóng gió dù sao cũng qua đi cậu về đến ngôi làng Lá của mình, cậu đã được thầy Iruka hướng dẫn và tập luyện, Tuy bướng bỉnh , nghịch ngợm có thể nói là kém thông minh nhưng bù lại là sự cố gắng không ngừng tất cả các tuyệt kỹ của thầy Iruka cậu đều học được, Cuối câu chuyện là sự hiện diện bất ngờ và bí ẩn của Akatsuki luôn rập rình và nguy hiểm , những pha phiêu lưu táo bạo và đầy kịch tính, những cuộc phiêu lưu mạo hiểm của Naruto trên Naruto Vietsub sẽ diễn ra như thế nào đây . Mời các bạn đón xem phần 1 của bộ phim trên trang http://vuighe.net/naruto-dattebayo . Đừng quên like và share để ủng hộ nhóm dịch nhé.', 'Đang cập nhập', '2004', 148065, 'HD', '26', 5, 9, 0, 'https://s199.imacdn.com/vg/2015/05/naruto-dattebayo-large-1432284981.jpg', '', 220, '220', ' THỨ 4 HÀNG TUẦN'),
(64, 'BRAVE 10', 'BRAVE 10', 'full', 2, '', 'Đang cập nhập', '2004', 148065, 'HD', '26', 5, 9, 0, 'https://s199.imacdn.com/vg/2015/05/brave-10-large-1432284982.jpg', '', 12, '12', ' THỨ 4 HÀNG TUẦN'),
(65, 'Thục Sơn Kỳ Tiên Lục', 'Thục Sơn Kỳ Tiên Lục', 'Đang phát hành', 3, 'Thời nhà Đường, biên giới hỗn loạn, Lý Hạo Bạch-chàng thanh niên đất Thục, ôm giấc mơ to lớn. Để thực hiện ước mơ cậu đã cùng Hồ Kiến tiến về Hàm Cốc Quan tham gia chiến trận. Yêu nghiệt nhân loạn thế gây rối, lão đạo sĩ Tiêu Dao Tử trừ yêu diệt quỷ khắp nơi. Mà ở Trường An xa xôi, lão đạo sĩ Tuần Quốc Sư lừa hoàng thượng, lợi dụng quyền thế bắt \"Long Thú\" để luyện tiên đơn. Lý Hạo Bạch vô tình dung hợp với \"Li Châu\" từ trong cơ thể của Long Thú, trở thành mục tiêu của biết bao kẻ. Không những là Tuần Quốc Sư muốn bắt mà còn nhiều người trên giang hồ muốn đoạt lấy Li Châu tu tiên. Trong lúc cùng đường, Lý Hạo Bạch được Tiêu Dao Tử ra tay cứu giúp, ông cảnh cáo Lý Hạo Bạch, nếu không lấy Li Châu ra, trả Li Châu lại cho long mạch trời đất. Cơ thể cậu phát nổ trong vòng 30 ngày. Đến lúc đó thiên hạ sẽ gặp tai họa lớn. Trên đường đến Hàm Cốc Quan cùng với Hồ Kiến, hai người gặp được A Y Mục - thiếu nữ lang thang người Tây vực. Ba người kết bạn, cùng nhau tiến đến Hàm Cốc Quan. Tiêu Dao Tử vì để bảo vệ Li Châu, cũng đành đi theo tùy cơ hành sự. Trên đường đi, 4người nhiều lần thoát khỏi truy sát của thuộc hạ Tuần Quốc Sư. Trong lúc đó, Li Châu cũng dần hợp thể với Lý Hạo Bạch, cậu vô tình dị hóa thành \"Hắc Long\". Bạch Long tượng trưng cho \"mặt trời\" bỗng xuất hiện, bám lấy Lý Hạo Bạch. Bạch Long cố tìm làm cho Tiêu Dao Tử rời khỏi Lý Bạch Hạo để ông truy tìm bí ẩn về Bạch Long. Tin tức về Li Châu truyền khắp thiên hạ, có Li Châu trong mình, Lý Hạo Bạch bị kỳ nhân dị sĩ khắp giang hồ đuổi giết.', 'đang cập nhật', '2021', 0, 'HD', '24', 5, 9, 0, 'https://animehay.club/upload/poster/3389-1638631627.jpg', '', 2, '??', 'T2 Mỗi tuần'),
(66, 'Kiếm Vực Phong Vân', 'Kiếm Vực Phong Vân', 'Đang phát hành', 3, 'Trong thời đại cổ lão của Kiếm Vực Đại Lục, có 10 thần kiếm và 5 gia tộc lớn. Lã Dương-hậu thế của Lã gia, trong lúc chạy trốn đã đánh thức được \"Đào thần kiếm\". Để tránh bị truy sát, cậu phiêu bạt khắp nơi, khắc khổ tu luyện, báo thù cho mẹ, tìm ra chân tướng. Cuối cùng xưng bá thiên hạ, đứng đầu Kiếm Vực Đại Lục.', 'đang cập nhật', '2021', 0, 'HD', '24', 0, 0, 0, 'https://animehay.club//upload/poster/3388.jpeg', '', 0, '', 'MỖI THỨ 4 VÀ CHỦ NHẬT HÀNG TUẦN'),
(67, 'Đắc Ý Nhất Nhân Gian', 'Đắc Ý Nhất Nhân Gian', 'Đang phát hành', 3, 'Main: Lý Phù Dao\n\nGái: Thanh Hòe, Diệp Sênh Ca\n\nCảnh giới tu vi:\n\nNhân Đạo: Chính Ý, Ninh Thần, Kiếm Khí, Thanh Ti, Thái Thanh, Triều Mộ, Xuân Thu, Đăng Lâu, Thương Hải\nCực Đạo: Cực Đạo, Chuẩn Quân, Thiên Quân', 'đang cập nhật', '2021', 0, 'HD', '24', 5, 8, 0, 'https://animehay.club//upload/poster/3376.png', '', 4, '60', ' THỨ 4 HÀNG TUẦN'),
(68, 'Độc Bộ Tiêu Dao', 'Độc Bộ Tiêu Dao', 'Đang phát hành', 3, 'Main: Diệp Vũ\n\nVợ: Tuyết Ngôn, Thi Tịnh Y, Nhan Thánh Đình\n\nCảnh giới:\n\n \n\n- Hồng Trần Cảnh\n\n \n\n- Uẩn Linh Cảnh\n\n \n\n- Tẩy Tủy Cảnh\n\n \n\n- Thánh Thai Cảnh\n\n \n\n- Thiên Nhân Cảnh\n\n \n\n- Thần Thông Cảnh (Thánh cảnh - Cực cảnh)\n\n \n\n- Đạo Chủng Cảnh (Vương giả)\n\n \n\n- Pháp Thân Cảnh (Kim Thân cảnh)\n\n \n\n- Pháp Tắc Cảnh (Đại Năng)\n\n \n\n- Hư Thánh\n\n \n\n- Bán Thánh\n\n \n\n- Thánh Nhân\n\n \n\n- Thánh Vương\n\n \n\n- Cổ Đế\n\n \n\n- Cấm Kỵ', 'đang cập nhật', '2021', 0, 'HD', '24', 4, 8, 0, 'https://animehay.club/upload/poster/3056.jpg', '', 16, '60', 'THỨ 4 HÀNG TUẦN'),
(69, 'Phàm Nhân Tu Tiên', 'Phàm Nhân Tu Tiên', 'Đang phát hành', 3, 'Từ tập 1-17: Phong Khởi Thiên Nam\n\nTừ tập 18-21: Yến Gia Bảo chi Chiến\n\nTừ tập 22-?? : Ma Đạo Tranh Phong\n\nMain: Hàn Lập\n\nVợ: Nam Cung Uyển\n\nCấp độ tu vi:\n\n-Nhân giới:\n\nLuyện khí kỳ (Sơ – Trung -Hậu)\n\nTrúc Cơ Kỳ (Sơ – Trung -Hậu)\n\nKết Đan Kỳ (Sơ – Trung -Hậu)\n\nNguyên Anh Kỳ (Sơ – Trung -Hậu)\n\nHoá Thần Kỳ (Sơ – Trung -Hậu)\n\n-Linh giới:\n\nLuyện Hư Kỳ (Sơ – Trung -Hậu)\n\nHợp Thể Kỳ (Sơ – Trung -Hậu)\n\nĐại Thừa Kỳ (Sơ – Trung -Hậu) phi thăng lên tiên giới. Cảnh giới cao nhất, hiểu được một phần quy tắc thiên hạ.', 'đang cập nhật', '2021', 0, 'HD', '24', 5, 10, 0, 'https://animehay.club//upload/poster/3376.png', '', 16, '60', 'THỨ 4 HÀNG TUẦN'),
(70, 'Thế Giới Hoàn Mỹ', 'Thế Giới Hoàn Mỹ', 'Đang phát hành', 3, 'Main: Hoang Thiên Đế - Thạch Hạo\n\nVợ: Hỏa Linh Nhi (chính thất), Vân Hi (mẹ của Tiểu Thạch Đầu), Thanh Y \n\nCảnh giới: \n\nPhàm Nhân:\n1.Bàn Huyết Cảnh: Sơ Kỳ – Trung Kỳ – Hậu Kỳ – Viên Mãn (Cực Cảnh)\n2.Động Thiên Cảnh: 1 Động Thiên – 10 Động Thiên (Cực Cảnh)\n3.Hóa Linh Cảnh: Thân Thể Thành Linh – Trọng Tố Chân Ngã – Động Thiên Dưỡng Linh\n4.Minh Văn Cảnh (Phong Hầu): Sơ Kỳ – Trung Kỳ – Hậu Kỳ – Viên Mãn\n5.Liệt Trận Cảnh (Vương Giả ): Sơ Kỳ – Trung Kỳ – Hậu Kỳ – Viên Mãn\n6.Tôn Giả Cảnh: Sơ Kỳ – Trung Kỳ – Hậu Kỳ – Viên Mãn\nThần Đạo:\n1.Thần Hỏa Cảnh (Ngụy Thần ): Sơ Kỳ – Trung Kỳ – Hậu Kỳ – Viên Mãn\n2.Chân Nhất Cảnh (Chân Thần): Sơ Kỳ – Trung Kỳ – Hậu Kỳ – Viên Mãn\n3.Thánh Tế Cảnh (Thần Vương): chiến lực thay đổi liên tục từ Tôn Giả tới Thiên Thần\n4.Thiên Thần Cảnh: Sơ Kỳ – Trung Kỳ – Hậu Kỳ – Viên Mãn\n5.Hư Đạo Cảnh\n6.Trảm Ngã Cảnh: Sơ Kỳ – Trung Kỳ – Hậu Kỳ – Viên Mãn\n7.Độn Nhất Cảnh (Chí Tôn): Sơ Kỳ – Trung Kỳ – Hậu Kỳ – Viên Mãn\n8.Chí Tôn Cảnh: Sơ Kỳ – Trung Kỳ – Hậu Kỳ – Viên Mãn\n9.Chí Tôn Cực Đạo (Nhân Đạo Đỉnh Phong)\nTiên Đạo (Trường Sinh Lĩnh Vực): 1.Chân Tiên 2.Tiên Vương: Yếu Nhược – Bình Thường – Tuyệt Đỉnh – Bá Chủ 3.Chuẩn Tiên Đế 4.Tiên Đế\nHệ Thống Tu Luyện do main tự sáng tạo: 1.Luân Hải Bí Cảnh  2.Đạo Cung Bí Cảnh  3.Tứ Cực Bí Cảnh  4.Hóa Long Bí Cảnh  5.Tiên Đài Bí Cảnh  5.1.Tiên Hồng Trần (Tiên khác loại): Nhất Thế – Cửu Thế  5.2.Đệ Thập Thế: Độ Kiếp Thành Chân Tiên 6.Ngẩng Đầu Ba Thước Có Thần Minh (Tiên Vương) 7.Thần Minh Hợp Nhất Với Cơ Thể (Chuẩn Tiên Đế) 8.Tiên Đế', 'đang cập nhật', '2021', 0, 'HD', '24', 4, 7, 0, 'https://animehay.club/upload/poster/3247-1637691191.jpg', '', 35, '78', 'TRƯA THỨ 6 HÀNG TUẦN'),
(71, 'Vụ Sơn Ngũ Hành', 'Vụ Sơn Ngũ Hành', 'Đang phát hành', 3, 'Thời thượng cổ yêu thú hoành hành, một vị đạo nhân thần bí đã ban năng lực đặc biệt của Âm Dương Ngũ Hành cho năm gia tộc Kim - Mộc - Thủy - Hỏa - Thổ để chống lại yêu thú. Bọn họ đánh đuổi yêu thú đến Thần Ẩn vụ sơn, lập ra kết giới. Trong Vụ sơn có linh thú Kỳ Lân hùng mạnh, thường thu hút những yêu thú muốn gia tăng yêu lực đột phá kết giới, nên tự nguyện bị phong ấn trong Cự Khuyết thần thuẫn. Hỏa Hành sứ giả - Văn Nhân Dực Huyền vì cứu mẹ đã tự ý mở Cự Khuyết thần thuẫn, Kỳ Lân con thừa cơ trốn ra ngoài, làm dấy lên một màn mưa máu gió trong giới yêu thú...', 'đang cập nhật', '2021', 0, 'HD', '24', 5, 9, 0, 'https://animehay.club//upload/poster/3382.jpg', '', 3, '3', 'TRƯA THỨ 6 HÀNG TUẦN'),
(72, 'Thiếu Niên Ca Hành', 'Thiếu Niên Ca Hành', 'Đang phát hành', 3, 'Các main: Tiêu Sắt - Tiêu Sở Hà ( vợ: Tư Không Thiên Lạc ), Lôi Vô Kiệt ( vợ: Diệp Nhược Y )\n\nNgoài ra còn có Vô Tâm - Diệp An Thế, tân tông chủ Thiên Ngoại Thiên\n\n \n\nCảnh giới: (từ Nhất phẩm đến Cửu phẩm)\n\nKim Cang Phàm Cảnh -> Tự Tại Địa Cảnh -> Tiêu Dao Thiên Cảnh -> Thần Du Huyền Cảnh\n\n \n\nSau khi Vong Ưu đại sư của Hàn Thủy Tự tọa hóa, một cỗ quan tài vàng thần bí nhập thế, vén lên phân tranh trong giang hồ. Thế lực các nơi đối chọi gay gắt, Lôi Vô Kiệt, Tiêu Sắt, Đường Liên, Tư Không Thiên Lạc, Thiên Nữ Nhụy lần lượt rơi vào phân tranh. Sách mã giang hồ mộng, ỷ kiếm đạp ca hành. Câu chuyện về bí mật của quan tài vàng dần dần được hé mở…', 'đang cập nhật', '2021', 0, 'HD', '24', 5, 10, 0, 'https://animehay.club/upload/poster/2713.jpg', '', 42, '42', 'TRƯA THỨ 6 HÀNG TUẦN'),
(73, 'Tinh Thần Biến Phần 3', 'Tinh Thần Biến Phần 3', 'Đang phát hành', 3, 'Vì để tìm tung tích của Ngọc Kiếm, dẫn đến đại chiến 3 tộc Tiên Ma Rồng, Tần Vũ dưới sự giúp đỡ của Lan thúc, đã có được thanh Ngọc Kiếm thứ 8, trở thành lãnh tụ của thế lực lớn thứ 4 đáy biển. Tần Vũ quyết tâm đối mặt với thử thách mới. Tập họp Ngọc Kiếm, mở Tiên Phủ. Cuối cùng Tiên Phủ từ từ mở ra, lúc bước vào bảo địa,  thử thách sinh tử chỉ mới bắt đầu', 'đang cập nhật', '2021', 0, 'HD', '24', 4, 9, 0, 'https://animehay.club/upload/poster/3316.jpg', '', 12, '13', 'TRƯA THỨ 6 HÀNG TUẦN'),
(74, '', 'Vạn Giới Độc Tôn', 'Đang phát hành', 3, 'Truyện chữ tên Vạn Giới Độc Tôn hoàn chỉnh chứ không phải pha trộn gì hết. Hiện đã tới chap 95.\n\nBên Trung đã không ra thêm chap nữa vì bản quyền được nhà làm phim mua mất rồi, nên muốn biết hết cốt truyện thì chờ xem phim đi nha.', 'đang cập nhật', '2021', 0, 'HD', '24', 5, 9, 0, 'https://animehay.club/upload/poster/3231.jpg', '', 47, '50', 'THỨ 3 VÀ THỨ 7 HÀNG TUẦN'),
(75, '', 'Họa Giang Hồ chi Bất Lương Nhân Phần 4', 'Đang phát hành', 3, 'Thập Vạn Đại Sơn nguy cơ tứ bề, chuyến đi Nhiêu Cương gian nan trắc trở. Thập Nhị Động có bí mật gì không thể để người khác biết? Đối diện với các thế lực lớn mạnh, đám người Lý Tinh Vân có thể toàn vẹn rút lui? Chuyến đi Nhiêu Cương thần bí khó lường này sắp sửa khởi hành...', 'đang cập nhật', '2021', 0, 'HD', '24', 4, 9, 0, 'https://animehay.club/upload/poster/3253.jpg', '', 12, '13', 'THỨ 3 VÀ THỨ 7 HÀNG TUẦN'),
(76, 'Mộ Vương Chi Vương phần 4: U Đô Chiến', 'Mộ Vương Chi Vương phần 4: U Đô Chiến', 'Đang phát hành', 3, 'Tiếp tục hành trình công phá Cửu Tỏa Liên Hoàn đại mộ. Phần 4 sẽ là cuộc tiến công U Đô Địa Phủ đại mộ nơi Mạc Bắc tái ngoại, đoạt lại Phá Mộ lệnh bị mất, lấy được U Đô Phá Mộ lệnh. Tranh đấu giữa Công Thủ Mộ phái lúc này lại xuất hiện một thế lực mới - U tộc của U Đô thành. Địa Phủ 18 tầng nguy cơ trùng trùng, bốn người Lạc Thời Thu, Lâu Mãn Phong, Hàn Thiên Lạc, Lâm Thủy Dao sẽ công phá như thế nào đây?', 'đang cập nhật', '2021', 0, 'HD', '24', 5, 8, 0, 'https://animehay.club/upload/poster/2942.jpg', '', 20, '26', 'T4 hàng tuần'),
(77, 'Sơn Hà Kiếm Tâm', 'Sơn Hà Kiếm Tâm', 'Đang phát hành', 3, 'Nội dung phim xoay quanh việc tông chủ Yến Vô Sư “nhặt được” chưởng môn Thẩm Kiều. Một người một lòng theo đuổi võ học tối cao, tùy tâm tùy ý; một người yêu ghét phân minh, không muốn thấy cảnh chiến tranh loạn lạc, khi ở bên nhau họ sẽ như thế nào đây?', 'đang cập nhật', '2021', 0, 'HD', '24', 4, 7, 0, 'https://animehay.club/upload/poster/3182.jpg', '', 14, '16', 'T4 hàng tuần'),
(78, '', 'Gối Đao Lên Hát', 'Đang phát hành', 3, 'Hà Phương Tri, chàng trai trẻ vốn dĩ là con của 1 vị quan, phải được ăn sung mặc sướng, sống an nhàn, nhưng lớn lên phải mang trong mình nỗi đau mất cha diệt nhà, nung nấu ý chí trả thù sau 13 năm tận mắt chứng kiến cha chết. Lên đường đi tìm kẻ chủ mưu thật sự, tự mình đối đầu với cả 1 thế lực lớn đằng sau.', 'đang cập nhật', '2021', 0, 'HD', '24', 5, 10, 0, 'https://animehay.club/upload/poster/3190.jpg', '', 12, '12', 'T4 hàng tuần'),
(79, 'Tần Thời Minh Nguyệt phần 6: Thương Hải Hoành Lưu', 'Tần Thời Minh Nguyệt phần 6: Thương Hải Hoành Lưu', 'Đang phát hành', 3, 'Lại là 1 cơn bão tố khác theo ánh mặt trời mọc, đập tan âm mưu hành thích của liên minh phản Tần, sự thống trị của Đại Tần bề ngoài trông có vẻ như đã bình lặng, dường như đêm qua không có chuyện gì xảy ra. Tần Thủy Hoàng uy vũ, thanh trừ thành công các thể lực phản Tần, buộc chúng phải lùi về ẩn nấu trong giang hồ...', 'đang cập nhật', '2021', 0, 'HD', '24', 5, 8, 0, 'https://animehay.club/upload/poster/3119.jpg', '', 25, '36', 'T4 hàng tuần'),
(80, 'Vũ Động Càn Khôn', 'Vũ Động Càn Khôn', 'Đang phát hành', 3, 'Main: Võ Tổ - Lâm Động\n\nVợ: Lăng Thanh Trúc, Ứng Hoan Hoan\n\nCấp độ tu vi:\n\n-Thối thể: từ nhất trọng đến thập trọng. Thối Thể chính là tu luyện thân thể, làm cho thân thể mình dần dần cường hóa, từ trong ra ngoài. Khi gân, cốt, tủy trong cơ thể được cường hóa đến trình tự nhất định, cũng là lúc phát sinh ra một tia nguyên lực, mà khi xuất hiện nguyên lực tức là đã chân chính trở thành một Tu Luyện Giả.\n\n-Địa Nguyên cảnh – Thiên Nguyên cảnh – Nguyên Đan cảnh (có tiểu viên mãn và đại viên mãn)\n\n-Tạo hoá tam cảnh: Tạo Hình cảnh -Tạo Khí cảnh – Tạo Hoá cảnh.\n\n-Niết bàn cảnh: nhất kiếp đến cửu kiếp.\n\n-Sinh tử cảnh: Sinh huyền cảnh – Tử huyền cảnh.\n\n-Luân hồi cảnh: Chuyển luân cảnh – luân hồi cảnh (nhất kiếp đến tam kiếp luân hồi).\n\n-Tổ cảnh.', 'đang cập nhật', '2021', 0, 'HD', '24', 5, 10, 0, 'https://animehay.club/upload/poster/2761.jpg', '', 24, '25', 'T4 hàng tuần'),
(81, 'Tiểu Sử Đại Binh Vạn Lý Trường Thành', 'Tiểu Sử Đại Binh Vạn Lý Trường Thành', 'Đang phát hành', 3, 'Câu chuyện: Kể về một tiểu tử họ Lang có tên là Tiểu Dã, vì cậu được nhặt nên có tên như vậy.Được nhận nuôi bởi nhà họ Lộc là loại động vật ăn cỏ. Ước mơ tiểu dã từ nhỏ là trở thành vị tướng thần vĩ đại. Một câu chuyện không may sau đó, Tiển nguyệt công chúa của bạch thần vương trên đường trở về cổng thần đã bị đã mất trí nhớ trông khi đang dữ trọng trách mình là bảo vệ dấu ấn hoàng đế.Vì thế Tiểu Dã sẽ là người giữ trọng trách ấy để bảo vệ tiển nguyệt và cũng giữ dấu ấn đưa về cánh cổng an toàn. Và cuộc hành trình ấy bắt đầu...', 'đang cập nhật', '2021', 0, 'HD', '24', 4, 9, 0, 'https://animehay.club/upload/poster/2948.jpg', '', 30, '40', 'T4 hàng tuần'),
(82, 'Tinh Thần Biến Phần 2', 'Tinh Thần Biến Phần 2', 'Đang phát hành', 3, 'Sau trận đại chiến độ kiếp của Tần Đức, Tần Vũ cùng tiểu Hắc tung tích không rõ, Tần Đức tức giận hồi triều tiến hành đánh chiếm Sở quốc, nhưng Tần Vũ sau đại nạn cũng chưa chết, đồng thời cùng tiểu Hắc vô tình đến Lôi Sơn Cư, được Lưu Tinh Lệ chữa trị thân thể, cùng Lôi Vệ...', 'đang cập nhật', '2021', 0, 'HD', '24', 4, 8, 0, 'https://animehay.club/upload/poster/3044.jpg', '', 10, '12', 'T4 hàng tuần'),
(83, 'Mộ Vương Chi Vương Phần 3: Huyền Quan Tự', 'Mộ Vương Chi Vương Phần 3: Huyền Quan Tự', 'Đang phát hành', 3, 'Phần này phái Công Mộ lại mở ra một hành trình mới tại Huyền Quan Tự, trong đó Huyền Quan Nhai không chỉ là ngôi đại mộ thứ 3 trong đại mộ Cửu Tỏa Liên Hoàn, mà còn là nơi hai phái Công Thủ tranh đoạt Lệnh Phá Mộ của Huyền Quan Nhai, trận ác chiến võ lâm cũng theo đó bùng nổ theo những mâu thuẫn xảy ra trong nội bộ Mộ phái.', 'đang cập nhật', '2021', 0, 'HD', '24', 5, 9, 0, 'https://animehay.club/upload/poster/2941.jpg', '', 19, '20', 'T4 hàng tuần'),
(84, 'Mộ Vương Chi Vương Phần 2: Hàn Thiết Đấu', 'Mộ Vương Chi Vương Phần 2: Hàn Thiết Đấu', 'FULL', 3, 'Mộ Vương Chi Vương Phần 2: Hàn Thiết Đấu bắt đầu với Luo Wu Zi giúp LiSi xây dựng gò đất của Tần Shi Wang (Hoàng đế đầu tiên thống nhất Trung Quốc). Các môn đệ của ông tiếp tục xây dựng và bảo vệ bia mộ hoàng gia. Ở giữa là sự xuất hiện của 9 ngôi mộ lớn, còn được gọi là King Great King of the Graves. Trong hàng ngàn năm, những ngôi mộ không bao giờ bị cướp. Người ngoài coi những người bảo vệ ngôi mộ là Tomb Sect. Sau cái chết của Luo Wu Zi, vị trí của Grave King được chuyển cho đệ tử lớn nhất của ông, Mu Rong Xiu. Câu chuyện tiếp tục…', 'đang cập nhật', '2021', 0, 'HD', '24', 5, 9, 0, 'https://animehay.club/upload/poster/2940.jpg', '', 10, '10', 'Ngừng'),
(85, 'Họa Giang Hồ chi Bất Lương Nhân Phần 3', 'Họa Giang Hồ chi Bất Lương Nhân Phần 3', 'FULL', 3, 'Bất Lương Nhân Phần 3', 'đang cập nhật', '2021', 0, 'HD', '24', 5, 9, 0, 'https://animehay.club/upload/poster/2700.jpg', '', 20, '20', 'Ngừng'),
(86, 'Tinh Thần Biến', 'Tinh Thần Biến', 'FULL', 3, 'Tần Vũ đã gặp duyên kỳ ngộ học được Tinh Thần Biến công pháp của Lôi Vệ, gian khổ tu luyện để làm cho người thân mình an toàn, nhờ sự giúp sức của Lan thúc(chú của người yêu) và Nghịch Ương tiên đế để phi thăng lên tiên giới và thần giới, nhưng rồi tại thần giới tranh đấu với cả nhà thần vương của Lôi Phạt thành và Lôi Phạt thiên tôn, cuối cùng nhờ sự giúp sức của Lôi Mông (sau này là nhị sư huynh của Tần Vũ và cũng là Lâm Lôi trong truyện Bàn Long cùng tác giả) phát triển lên sau này đã sáng tạo ra Tần Mông vũ trụ của riêng mình', 'đang cập nhật', '2021', 0, 'HD', '24', 5, 9, 0, 'https://animehay.club/upload/poster/2663.jpg', '', 12, '12', 'Ngừng'),
(87, 'Võ Lâm 3 : Thẩm Kiếm Tâm', 'Võ Lâm 3 : Thẩm Kiếm Tâm', 'FULL', 3, 'Phim dựa theo game võ lâm 3 | jx3, xoay quanh thẩm kiếm tâm', 'đang cập nhật', '2021', 0, 'HD', '24', 4, 9, 0, 'https://animehay.club/upload/poster/2655.jpg', '', 12, '12', 'Ngừng'),
(88, 'Trạch Thiên Ký Phần 1+2+3', 'Trạch Thiên Ký Phần 1+2+4', 'FULL', 3, 'Thái Thủy nguyên niên, có thần thạch từ không gian bay tới, phân tán khắp nhân gian, trong đó có thần thạch rơi vào Đông Thổ đại lục, phía trên có khắc đồ đằng kỳ quái, có người bởi vì xem đồ đằng mà ngộ đạo, sau lập ra quốc giáo.\n\nMấy ngàn năm sau, thiếu niên cô nhi Trần Trường Sinh mười bốn tuổi, vì chữa bệnh cải mệnh rời khỏi sư phụ của mình, mang theo một tờ hôn ước đi tới thần đô, từ đó mở ra một hành trình quật khởi của nghịch thiên cường giả.', 'đang cập nhật', '2021', 0, 'HD', '24', 4, 9, 0, 'https://animehay.club/upload/poster/1643.jpg', '', 37, '37', 'Ngừng'),
(89, 'Yasuke', 'Yasuke', 'FULL', 3, 'Anh đến từ châu Phi và chiến đấu sát cánh lãnh chúa phong kiến hùng mạnh trong thế kỷ 16 đầy bạo tàn ở Nhật Bản. Họ gọi anh là Samurai đen và anh trở thành huyền thoại.', 'đang cập nhật', '2021', 0, 'HD', '24', 4, 9, 0, 'https://animehay.club/upload/poster/3254.jpg', '', 6, '6', 'Ngừng'),
(90, 'Gibiate', 'Gibiate', 'FULL', 3, 'Câu chuyện xảy ra ở Nhật Bản. Vào năm 2030, Trái Đất đã hoàn toàn sụp đổ bởi dịch bệnh mang tên \"Gibiate\" sẽ biến những người nhiễm bệnh trở thành quái vật dựa theo độ tuổi, sắc tộc, giới tính.\n\nMột samurai và ninja từ thời Edo đã vô tình du hành thời gian và đến với Tokyo đang sụp đổ để trợ giúp vị tiến sĩ tìm ra phương thuốc cho loại virus này.\n\nCùng nhau, họ chiến đấu chống lại lũ quái vật Gibiate, bọn tội phạm, và những kẻ thù ngăn cản họ trên con đường cứu rỗi nhân loại.', 'đang cập nhật', '2021', 0, 'HD', '24', 4, 9, 0, 'https://animehay.club/upload/poster/3073.jpg', '', 12, '12', 'Ngừng'),
(91, 'Bakumatsu: Crisis', 'Renai Bakumatsu Kareshi Gaiden, Bakumatsu Second Season, Bakumatsu 2nd Season', 'FULL', 3, 'Mùa thứ 2 của anime Bakumatsu', 'đang cập nhật', '2021', 0, 'HD', '24', 4, 9, 0, 'https://animehay.club/upload/poster/2976.jpg', '', 12, '12', 'Ngừng'),
(92, 'Kochouki: Wakaki Nobunaga', 'Kochouki: Wakaki Nobunaga', 'FULL', 3, 'Bộ này là một bộ phim lịch sử thẩm mỹ và mạnh dạn chuyển thể cuộc sống của Oda Nobunaga ở tuổi thiếu niên cho đến khi trở thành lãnh chúa chống lại anh trai của mình, Nobuyuki. ', 'đang cập nhật', '2021', 0, 'HD', '24', 4, 9, 0, 'https://animehay.club/upload/poster/2856.jpg', '', 12, '12', 'Ngừng'),
(93, 'Gintama.: Shirogane no Tamashii-hen 2', 'Gintama.: Shirogane no Tamashii-hen 2', 'FULL', 3, 'Gintama phần 6', 'đang cập nhật', '2021', 0, 'HD', '24', 4, 9, 0, 'https://animehay.club/upload/poster/2582.jpg', '', 14, '14', 'Ngừng'),
(94, 'Angolmois: Genkou Kassenki', 'Angolmois: Genkou Kassenki', 'FULL', 3, 'Vào thế kỷ XIII, sức mạnh quân sự của đế quốc Mông Cổ đã bành trướng khắp các quốc gia phương Tây lẫn phương Đông.\n“Mông Cổ – đó chính là nơi vị vua sẽ huỷ diệt thế giới (Angolmois) xuất hiện!” ― Nostradamus\n―Nửa sau thế kỷ XIII, nanh vuốt của quân Mông Cổ đã hướng đến đảo quốc Nhật Bản.\nNăm 1274, nhà Nguyên phái 3 vạn quân liên minh với Cao Ly cùng 900 chiến thuyền vượt biển sang xâm lược Nhật Bản, dân gian gọi là “Genkou” (Nguyên Khấu – Cuộc xâm lược của nhà Nguyên). Cuộc xâm lược bắt đầu tại đảo Tsushima với những cuộc thảm sát dã man và hủy diệt khủng khiếp. Đây là câu chuyện về những samurai cùng những con người bất khuất trên đảo chống lại ách xâm lược của quân Nguyên Mông.', 'đang cập nhật', '2021', 0, 'HD', '24', 5, 10, 0, 'https://animehay.club/upload/poster/2591.jpg', '', 12, '12', 'Ngừng'),
(95, 'Thục Sơn Kỳ Tiên Lục', 'Thục Sơn Kỳ Tiên Lục', 'Đang phát hành', 3, 'Thời nhà Đường, biên giới hỗn loạn, Lý Hạo Bạch-chàng thanh niên đất Thục, ôm giấc mơ to lớn. Để thực hiện ước mơ cậu đã cùng Hồ Kiến tiến về Hàm Cốc Quan tham gia chiến trận. Yêu nghiệt nhân loạn thế gây rối, lão đạo sĩ Tiêu Dao Tử trừ yêu diệt quỷ khắp nơi. Mà ở Trường An xa xôi, lão đạo sĩ Tuần Quốc Sư lừa hoàng thượng, lợi dụng quyền thế bắt \"Long Thú\" để luyện tiên đơn. Lý Hạo Bạch vô tình dung hợp với \"Li Châu\" từ trong cơ thể của Long Thú, trở thành mục tiêu của biết bao kẻ. Không những là Tuần Quốc Sư muốn bắt mà còn nhiều người trên giang hồ muốn đoạt lấy Li Châu tu tiên. Trong lúc cùng đường, Lý Hạo Bạch được Tiêu Dao Tử ra tay cứu giúp, ông cảnh cáo Lý Hạo Bạch, nếu không lấy Li Châu ra, trả Li Châu lại cho long mạch trời đất. Cơ thể cậu phát nổ trong vòng 30 ngày. Đến lúc đó thiên hạ sẽ gặp tai họa lớn. Trên đường đến Hàm Cốc Quan cùng với Hồ Kiến, hai người gặp được A Y Mục - thiếu nữ lang thang người Tây vực. Ba người kết bạn, cùng nhau tiến đến Hàm Cốc Quan. Tiêu Dao Tử vì để bảo vệ Li Châu, cũng đành đi theo tùy cơ hành sự. Trên đường đi, 4người nhiều lần thoát khỏi truy sát của thuộc hạ Tuần Quốc Sư. Trong lúc đó, Li Châu cũng dần hợp thể với Lý Hạo Bạch, cậu vô tình dị hóa thành \"Hắc Long\". Bạch Long tượng trưng cho \"mặt trời\" bỗng xuất hiện, bám lấy Lý Hạo Bạch. Bạch Long cố tìm làm cho Tiêu Dao Tử rời khỏi Lý Bạch Hạo để ông truy tìm bí ẩn về Bạch Long. Tin tức về Li Châu truyền khắp thiên hạ, có Li Châu trong mình, Lý Hạo Bạch bị kỳ nhân dị sĩ khắp giang hồ đuổi giết.', 'đang cập nhật', '2021', 0, 'HD', '24', 5, 9, 0, 'https://animehay.club/upload/poster/3389-1638631627.jpg', '', 2, '??', 'T2 Mỗi tuần'),
(96, 'Kiếm Vực Phong Vân', 'Kiếm Vực Phong Vân', 'Đang phát hành', 3, 'Trong thời đại cổ lão của Kiếm Vực Đại Lục, có 10 thần kiếm và 5 gia tộc lớn. Lã Dương-hậu thế của Lã gia, trong lúc chạy trốn đã đánh thức được \"Đào thần kiếm\". Để tránh bị truy sát, cậu phiêu bạt khắp nơi, khắc khổ tu luyện, báo thù cho mẹ, tìm ra chân tướng. Cuối cùng xưng bá thiên hạ, đứng đầu Kiếm Vực Đại Lục.', 'đang cập nhật', '2021', 0, 'HD', '24', 0, 0, 0, 'https://animehay.club//upload/poster/3388.jpeg', '', 0, '', 'MỖI THỨ 4 VÀ CHỦ NHẬT HÀNG TUẦN'),
(97, 'Đắc Ý Nhất Nhân Gian', 'Đắc Ý Nhất Nhân Gian', 'Đang phát hành', 3, 'Main: Lý Phù Dao\n\nGái: Thanh Hòe, Diệp Sênh Ca\n\nCảnh giới tu vi:\n\nNhân Đạo: Chính Ý, Ninh Thần, Kiếm Khí, Thanh Ti, Thái Thanh, Triều Mộ, Xuân Thu, Đăng Lâu, Thương Hải\nCực Đạo: Cực Đạo, Chuẩn Quân, Thiên Quân', 'đang cập nhật', '2021', 0, 'HD', '24', 5, 8, 0, 'https://animehay.club//upload/poster/3376.png', '', 4, '60', ' THỨ 4 HÀNG TUẦN'),
(98, 'Độc Bộ Tiêu Dao', 'Độc Bộ Tiêu Dao', 'Đang phát hành', 3, 'Main: Diệp Vũ\n\nVợ: Tuyết Ngôn, Thi Tịnh Y, Nhan Thánh Đình\n\nCảnh giới:\n\n \n\n- Hồng Trần Cảnh\n\n \n\n- Uẩn Linh Cảnh\n\n \n\n- Tẩy Tủy Cảnh\n\n \n\n- Thánh Thai Cảnh\n\n \n\n- Thiên Nhân Cảnh\n\n \n\n- Thần Thông Cảnh (Thánh cảnh - Cực cảnh)\n\n \n\n- Đạo Chủng Cảnh (Vương giả)\n\n \n\n- Pháp Thân Cảnh (Kim Thân cảnh)\n\n \n\n- Pháp Tắc Cảnh (Đại Năng)\n\n \n\n- Hư Thánh\n\n \n\n- Bán Thánh\n\n \n\n- Thánh Nhân\n\n \n\n- Thánh Vương\n\n \n\n- Cổ Đế\n\n \n\n- Cấm Kỵ', 'đang cập nhật', '2021', 0, 'HD', '24', 4, 8, 0, 'https://animehay.club/upload/poster/3056.jpg', '', 16, '60', 'THỨ 4 HÀNG TUẦN'),
(99, 'Phàm Nhân Tu Tiên', 'Phàm Nhân Tu Tiên', 'Đang phát hành', 3, 'Từ tập 1-17: Phong Khởi Thiên Nam\n\nTừ tập 18-21: Yến Gia Bảo chi Chiến\n\nTừ tập 22-?? : Ma Đạo Tranh Phong\n\nMain: Hàn Lập\n\nVợ: Nam Cung Uyển\n\nCấp độ tu vi:\n\n-Nhân giới:\n\nLuyện khí kỳ (Sơ – Trung -Hậu)\n\nTrúc Cơ Kỳ (Sơ – Trung -Hậu)\n\nKết Đan Kỳ (Sơ – Trung -Hậu)\n\nNguyên Anh Kỳ (Sơ – Trung -Hậu)\n\nHoá Thần Kỳ (Sơ – Trung -Hậu)\n\n-Linh giới:\n\nLuyện Hư Kỳ (Sơ – Trung -Hậu)\n\nHợp Thể Kỳ (Sơ – Trung -Hậu)\n\nĐại Thừa Kỳ (Sơ – Trung -Hậu) phi thăng lên tiên giới. Cảnh giới cao nhất, hiểu được một phần quy tắc thiên hạ.', 'đang cập nhật', '2021', 0, 'HD', '24', 5, 10, 0, 'https://animehay.club//upload/poster/3376.png', '', 16, '60', 'THỨ 4 HÀNG TUẦN'),
(100, 'Thế Giới Hoàn Mỹ', 'Thế Giới Hoàn Mỹ', 'Đang phát hành', 3, 'Main: Hoang Thiên Đế - Thạch Hạo\n\nVợ: Hỏa Linh Nhi (chính thất), Vân Hi (mẹ của Tiểu Thạch Đầu), Thanh Y \n\nCảnh giới: \n\nPhàm Nhân:\n1.Bàn Huyết Cảnh: Sơ Kỳ – Trung Kỳ – Hậu Kỳ – Viên Mãn (Cực Cảnh)\n2.Động Thiên Cảnh: 1 Động Thiên – 10 Động Thiên (Cực Cảnh)\n3.Hóa Linh Cảnh: Thân Thể Thành Linh – Trọng Tố Chân Ngã – Động Thiên Dưỡng Linh\n4.Minh Văn Cảnh (Phong Hầu): Sơ Kỳ – Trung Kỳ – Hậu Kỳ – Viên Mãn\n5.Liệt Trận Cảnh (Vương Giả ): Sơ Kỳ – Trung Kỳ – Hậu Kỳ – Viên Mãn\n6.Tôn Giả Cảnh: Sơ Kỳ – Trung Kỳ – Hậu Kỳ – Viên Mãn\nThần Đạo:\n1.Thần Hỏa Cảnh (Ngụy Thần ): Sơ Kỳ – Trung Kỳ – Hậu Kỳ – Viên Mãn\n2.Chân Nhất Cảnh (Chân Thần): Sơ Kỳ – Trung Kỳ – Hậu Kỳ – Viên Mãn\n3.Thánh Tế Cảnh (Thần Vương): chiến lực thay đổi liên tục từ Tôn Giả tới Thiên Thần\n4.Thiên Thần Cảnh: Sơ Kỳ – Trung Kỳ – Hậu Kỳ – Viên Mãn\n5.Hư Đạo Cảnh\n6.Trảm Ngã Cảnh: Sơ Kỳ – Trung Kỳ – Hậu Kỳ – Viên Mãn\n7.Độn Nhất Cảnh (Chí Tôn): Sơ Kỳ – Trung Kỳ – Hậu Kỳ – Viên Mãn\n8.Chí Tôn Cảnh: Sơ Kỳ – Trung Kỳ – Hậu Kỳ – Viên Mãn\n9.Chí Tôn Cực Đạo (Nhân Đạo Đỉnh Phong)\nTiên Đạo (Trường Sinh Lĩnh Vực): 1.Chân Tiên 2.Tiên Vương: Yếu Nhược – Bình Thường – Tuyệt Đỉnh – Bá Chủ 3.Chuẩn Tiên Đế 4.Tiên Đế\nHệ Thống Tu Luyện do main tự sáng tạo: 1.Luân Hải Bí Cảnh  2.Đạo Cung Bí Cảnh  3.Tứ Cực Bí Cảnh  4.Hóa Long Bí Cảnh  5.Tiên Đài Bí Cảnh  5.1.Tiên Hồng Trần (Tiên khác loại): Nhất Thế – Cửu Thế  5.2.Đệ Thập Thế: Độ Kiếp Thành Chân Tiên 6.Ngẩng Đầu Ba Thước Có Thần Minh (Tiên Vương) 7.Thần Minh Hợp Nhất Với Cơ Thể (Chuẩn Tiên Đế) 8.Tiên Đế', 'đang cập nhật', '2021', 0, 'HD', '24', 4, 7, 0, 'https://animehay.club/upload/poster/3247-1637691191.jpg', '', 35, '78', 'TRƯA THỨ 6 HÀNG TUẦN'),
(101, 'Vụ Sơn Ngũ Hành', 'Vụ Sơn Ngũ Hành', 'Đang phát hành', 3, 'Thời thượng cổ yêu thú hoành hành, một vị đạo nhân thần bí đã ban năng lực đặc biệt của Âm Dương Ngũ Hành cho năm gia tộc Kim - Mộc - Thủy - Hỏa - Thổ để chống lại yêu thú. Bọn họ đánh đuổi yêu thú đến Thần Ẩn vụ sơn, lập ra kết giới. Trong Vụ sơn có linh thú Kỳ Lân hùng mạnh, thường thu hút những yêu thú muốn gia tăng yêu lực đột phá kết giới, nên tự nguyện bị phong ấn trong Cự Khuyết thần thuẫn. Hỏa Hành sứ giả - Văn Nhân Dực Huyền vì cứu mẹ đã tự ý mở Cự Khuyết thần thuẫn, Kỳ Lân con thừa cơ trốn ra ngoài, làm dấy lên một màn mưa máu gió trong giới yêu thú...', 'đang cập nhật', '2021', 0, 'HD', '24', 5, 9, 0, 'https://animehay.club//upload/poster/3382.jpg', '', 3, '3', 'TRƯA THỨ 6 HÀNG TUẦN'),
(102, 'Thiếu Niên Ca Hành', 'Thiếu Niên Ca Hành', 'Đang phát hành', 3, 'Các main: Tiêu Sắt - Tiêu Sở Hà ( vợ: Tư Không Thiên Lạc ), Lôi Vô Kiệt ( vợ: Diệp Nhược Y )\n\nNgoài ra còn có Vô Tâm - Diệp An Thế, tân tông chủ Thiên Ngoại Thiên\n\n \n\nCảnh giới: (từ Nhất phẩm đến Cửu phẩm)\n\nKim Cang Phàm Cảnh -> Tự Tại Địa Cảnh -> Tiêu Dao Thiên Cảnh -> Thần Du Huyền Cảnh\n\n \n\nSau khi Vong Ưu đại sư của Hàn Thủy Tự tọa hóa, một cỗ quan tài vàng thần bí nhập thế, vén lên phân tranh trong giang hồ. Thế lực các nơi đối chọi gay gắt, Lôi Vô Kiệt, Tiêu Sắt, Đường Liên, Tư Không Thiên Lạc, Thiên Nữ Nhụy lần lượt rơi vào phân tranh. Sách mã giang hồ mộng, ỷ kiếm đạp ca hành. Câu chuyện về bí mật của quan tài vàng dần dần được hé mở…', 'đang cập nhật', '2021', 0, 'HD', '24', 5, 10, 0, 'https://animehay.club/upload/poster/2713.jpg', '', 42, '42', 'TRƯA THỨ 6 HÀNG TUẦN'),
(103, 'Tinh Thần Biến Phần 3', 'Tinh Thần Biến Phần 3', 'Đang phát hành', 3, 'Vì để tìm tung tích của Ngọc Kiếm, dẫn đến đại chiến 3 tộc Tiên Ma Rồng, Tần Vũ dưới sự giúp đỡ của Lan thúc, đã có được thanh Ngọc Kiếm thứ 8, trở thành lãnh tụ của thế lực lớn thứ 4 đáy biển. Tần Vũ quyết tâm đối mặt với thử thách mới. Tập họp Ngọc Kiếm, mở Tiên Phủ. Cuối cùng Tiên Phủ từ từ mở ra, lúc bước vào bảo địa,  thử thách sinh tử chỉ mới bắt đầu', 'đang cập nhật', '2021', 0, 'HD', '24', 4, 9, 0, 'https://animehay.club/upload/poster/3316.jpg', '', 12, '13', 'TRƯA THỨ 6 HÀNG TUẦN'),
(104, 'Vạn Giới Độc Tôn', 'Vạn Giới Độc Tôn', 'Đang phát hành', 3, 'Truyện chữ tên Vạn Giới Độc Tôn hoàn chỉnh chứ không phải pha trộn gì hết. Hiện đã tới chap 95.\n\nBên Trung đã không ra thêm chap nữa vì bản quyền được nhà làm phim mua mất rồi, nên muốn biết hết cốt truyện thì chờ xem phim đi nha.', 'đang cập nhật', '2021', 0, 'HD', '24', 5, 9, 0, 'https://animehay.club/upload/poster/3231.jpg', '', 47, '50', 'THỨ 3 VÀ THỨ 7 HÀNG TUẦN'),
(105, 'Họa Giang Hồ chi Bất Lương Nhân Phần 4', 'Họa Giang Hồ chi Bất Lương Nhân Phần 4', 'Đang phát hành', 3, 'Thập Vạn Đại Sơn nguy cơ tứ bề, chuyến đi Nhiêu Cương gian nan trắc trở. Thập Nhị Động có bí mật gì không thể để người khác biết? Đối diện với các thế lực lớn mạnh, đám người Lý Tinh Vân có thể toàn vẹn rút lui? Chuyến đi Nhiêu Cương thần bí khó lường này sắp sửa khởi hành...', 'đang cập nhật', '2021', 0, 'HD', '24', 4, 9, 0, 'https://animehay.club/upload/poster/3253.jpg', '', 12, '13', 'THỨ 3 VÀ THỨ 7 HÀNG TUẦN'),
(106, 'Mộ Vương Chi Vương phần 4: U Đô Chiến', 'Mộ Vương Chi Vương phần 4: U Đô Chiến', 'Đang phát hành', 3, 'Tiếp tục hành trình công phá Cửu Tỏa Liên Hoàn đại mộ. Phần 4 sẽ là cuộc tiến công U Đô Địa Phủ đại mộ nơi Mạc Bắc tái ngoại, đoạt lại Phá Mộ lệnh bị mất, lấy được U Đô Phá Mộ lệnh. Tranh đấu giữa Công Thủ Mộ phái lúc này lại xuất hiện một thế lực mới - U tộc của U Đô thành. Địa Phủ 18 tầng nguy cơ trùng trùng, bốn người Lạc Thời Thu, Lâu Mãn Phong, Hàn Thiên Lạc, Lâm Thủy Dao sẽ công phá như thế nào đây?', 'đang cập nhật', '2021', 0, 'HD', '24', 5, 8, 0, 'https://animehay.club/upload/poster/2942.jpg', '', 20, '26', 'T4 hàng tuần'),
(107, 'Sơn Hà Kiếm Tâm', 'Sơn Hà Kiếm Tâm', 'Đang phát hành', 3, 'Nội dung phim xoay quanh việc tông chủ Yến Vô Sư “nhặt được” chưởng môn Thẩm Kiều. Một người một lòng theo đuổi võ học tối cao, tùy tâm tùy ý; một người yêu ghét phân minh, không muốn thấy cảnh chiến tranh loạn lạc, khi ở bên nhau họ sẽ như thế nào đây?', 'đang cập nhật', '2021', 0, 'HD', '24', 4, 7, 0, 'https://animehay.club/upload/poster/3182.jpg', '', 14, '16', 'T4 hàng tuần'),
(108, 'Gối Đao Lên Hát', 'Gối Đao Lên Hát', 'Đang phát hành', 3, 'Hà Phương Tri, chàng trai trẻ vốn dĩ là con của 1 vị quan, phải được ăn sung mặc sướng, sống an nhàn, nhưng lớn lên phải mang trong mình nỗi đau mất cha diệt nhà, nung nấu ý chí trả thù sau 13 năm tận mắt chứng kiến cha chết. Lên đường đi tìm kẻ chủ mưu thật sự, tự mình đối đầu với cả 1 thế lực lớn đằng sau.', 'đang cập nhật', '2021', 0, 'HD', '24', 5, 10, 0, 'https://animehay.club/upload/poster/3190.jpg', '', 12, '12', 'T4 hàng tuần'),
(109, 'Tần Thời Minh Nguyệt phần 6: Thương Hải Hoành Lưu', 'Tần Thời Minh Nguyệt phần 6: Thương Hải Hoành Lưu', 'Đang phát hành', 3, 'Lại là 1 cơn bão tố khác theo ánh mặt trời mọc, đập tan âm mưu hành thích của liên minh phản Tần, sự thống trị của Đại Tần bề ngoài trông có vẻ như đã bình lặng, dường như đêm qua không có chuyện gì xảy ra. Tần Thủy Hoàng uy vũ, thanh trừ thành công các thể lực phản Tần, buộc chúng phải lùi về ẩn nấu trong giang hồ...', 'đang cập nhật', '2021', 0, 'HD', '24', 5, 8, 0, 'https://animehay.club/upload/poster/3119.jpg', '', 25, '36', 'T4 hàng tuần'),
(110, 'Vũ Động Càn Khôn', 'Vũ Động Càn Khôn', 'Đang phát hành', 3, 'Main: Võ Tổ - Lâm Động\n\nVợ: Lăng Thanh Trúc, Ứng Hoan Hoan\n\nCấp độ tu vi:\n\n-Thối thể: từ nhất trọng đến thập trọng. Thối Thể chính là tu luyện thân thể, làm cho thân thể mình dần dần cường hóa, từ trong ra ngoài. Khi gân, cốt, tủy trong cơ thể được cường hóa đến trình tự nhất định, cũng là lúc phát sinh ra một tia nguyên lực, mà khi xuất hiện nguyên lực tức là đã chân chính trở thành một Tu Luyện Giả.\n\n-Địa Nguyên cảnh – Thiên Nguyên cảnh – Nguyên Đan cảnh (có tiểu viên mãn và đại viên mãn)\n\n-Tạo hoá tam cảnh: Tạo Hình cảnh -Tạo Khí cảnh – Tạo Hoá cảnh.\n\n-Niết bàn cảnh: nhất kiếp đến cửu kiếp.\n\n-Sinh tử cảnh: Sinh huyền cảnh – Tử huyền cảnh.\n\n-Luân hồi cảnh: Chuyển luân cảnh – luân hồi cảnh (nhất kiếp đến tam kiếp luân hồi).\n\n-Tổ cảnh.', 'đang cập nhật', '2021', 0, 'HD', '24', 5, 10, 0, 'https://animehay.club/upload/poster/2761.jpg', '', 24, '25', 'T4 hàng tuần'),
(111, 'Tiểu Sử Đại Binh Vạn Lý Trường Thành', 'Tiểu Sử Đại Binh Vạn Lý Trường Thành', 'Đang phát hành', 3, 'Câu chuyện: Kể về một tiểu tử họ Lang có tên là Tiểu Dã, vì cậu được nhặt nên có tên như vậy.Được nhận nuôi bởi nhà họ Lộc là loại động vật ăn cỏ. Ước mơ tiểu dã từ nhỏ là trở thành vị tướng thần vĩ đại. Một câu chuyện không may sau đó, Tiển nguyệt công chúa của bạch thần vương trên đường trở về cổng thần đã bị đã mất trí nhớ trông khi đang dữ trọng trách mình là bảo vệ dấu ấn hoàng đế.Vì thế Tiểu Dã sẽ là người giữ trọng trách ấy để bảo vệ tiển nguyệt và cũng giữ dấu ấn đưa về cánh cổng an toàn. Và cuộc hành trình ấy bắt đầu...', 'đang cập nhật', '2021', 0, 'HD', '24', 4, 9, 0, 'https://animehay.club/upload/poster/2948.jpg', '', 30, '40', 'T4 hàng tuần'),
(112, 'Tinh Thần Biến Phần 2', 'Tinh Thần Biến Phần 2', 'Đang phát hành', 3, 'Sau trận đại chiến độ kiếp của Tần Đức, Tần Vũ cùng tiểu Hắc tung tích không rõ, Tần Đức tức giận hồi triều tiến hành đánh chiếm Sở quốc, nhưng Tần Vũ sau đại nạn cũng chưa chết, đồng thời cùng tiểu Hắc vô tình đến Lôi Sơn Cư, được Lưu Tinh Lệ chữa trị thân thể, cùng Lôi Vệ...', 'đang cập nhật', '2021', 0, 'HD', '24', 4, 8, 0, 'https://animehay.club/upload/poster/3044.jpg', '', 10, '12', 'T4 hàng tuần'),
(113, 'Mộ Vương Chi Vương Phần 3: Huyền Quan Tự', 'Mộ Vương Chi Vương Phần 3: Huyền Quan Tự', 'Đang phát hành', 3, 'Phần này phái Công Mộ lại mở ra một hành trình mới tại Huyền Quan Tự, trong đó Huyền Quan Nhai không chỉ là ngôi đại mộ thứ 3 trong đại mộ Cửu Tỏa Liên Hoàn, mà còn là nơi hai phái Công Thủ tranh đoạt Lệnh Phá Mộ của Huyền Quan Nhai, trận ác chiến võ lâm cũng theo đó bùng nổ theo những mâu thuẫn xảy ra trong nội bộ Mộ phái.', 'đang cập nhật', '2021', 0, 'HD', '24', 5, 9, 0, 'https://animehay.club/upload/poster/2941.jpg', '', 19, '20', 'T4 hàng tuần'),
(114, 'Mộ Vương Chi Vương Phần 2: Hàn Thiết Đấu', 'Mộ Vương Chi Vương Phần 2: Hàn Thiết Đấu', 'FULL', 3, 'Mộ Vương Chi Vương Phần 2: Hàn Thiết Đấu bắt đầu với Luo Wu Zi giúp LiSi xây dựng gò đất của Tần Shi Wang (Hoàng đế đầu tiên thống nhất Trung Quốc). Các môn đệ của ông tiếp tục xây dựng và bảo vệ bia mộ hoàng gia. Ở giữa là sự xuất hiện của 9 ngôi mộ lớn, còn được gọi là King Great King of the Graves. Trong hàng ngàn năm, những ngôi mộ không bao giờ bị cướp. Người ngoài coi những người bảo vệ ngôi mộ là Tomb Sect. Sau cái chết của Luo Wu Zi, vị trí của Grave King được chuyển cho đệ tử lớn nhất của ông, Mu Rong Xiu. Câu chuyện tiếp tục…', 'đang cập nhật', '2021', 0, 'HD', '24', 5, 9, 0, 'https://animehay.club/upload/poster/2940.jpg', '', 10, '10', 'Ngừng'),
(115, 'Họa Giang Hồ chi Bất Lương Nhân Phần 3', 'Họa Giang Hồ chi Bất Lương Nhân Phần 3', 'FULL', 3, 'Bất Lương Nhân Phần 3', 'đang cập nhật', '2021', 0, 'HD', '24', 5, 9, 0, 'https://animehay.club/upload/poster/2700.jpg', '', 20, '20', 'Ngừng'),
(116, 'Tinh Thần Biến', 'Tinh Thần Biến', 'FULL', 3, 'Tần Vũ đã gặp duyên kỳ ngộ học được Tinh Thần Biến công pháp của Lôi Vệ, gian khổ tu luyện để làm cho người thân mình an toàn, nhờ sự giúp sức của Lan thúc(chú của người yêu) và Nghịch Ương tiên đế để phi thăng lên tiên giới và thần giới, nhưng rồi tại thần giới tranh đấu với cả nhà thần vương của Lôi Phạt thành và Lôi Phạt thiên tôn, cuối cùng nhờ sự giúp sức của Lôi Mông (sau này là nhị sư huynh của Tần Vũ và cũng là Lâm Lôi trong truyện Bàn Long cùng tác giả) phát triển lên sau này đã sáng tạo ra Tần Mông vũ trụ của riêng mình', 'đang cập nhật', '2021', 0, 'HD', '24', 5, 9, 0, 'https://animehay.club/upload/poster/2663.jpg', '', 12, '12', 'Ngừng'),
(117, 'Võ Lâm 3 : Thẩm Kiếm Tâm', 'Võ Lâm 3 : Thẩm Kiếm Tâm', 'FULL', 3, 'Phim dựa theo game võ lâm 3 | jx3, xoay quanh thẩm kiếm tâm', 'đang cập nhật', '2021', 0, 'HD', '24', 4, 9, 0, 'https://animehay.club/upload/poster/2655.jpg', '', 12, '12', 'Ngừng'),
(118, 'Trạch Thiên Ký Phần 1+2+3', 'Trạch Thiên Ký Phần 1+2+4', 'FULL', 3, 'Thái Thủy nguyên niên, có thần thạch từ không gian bay tới, phân tán khắp nhân gian, trong đó có thần thạch rơi vào Đông Thổ đại lục, phía trên có khắc đồ đằng kỳ quái, có người bởi vì xem đồ đằng mà ngộ đạo, sau lập ra quốc giáo.\n\nMấy ngàn năm sau, thiếu niên cô nhi Trần Trường Sinh mười bốn tuổi, vì chữa bệnh cải mệnh rời khỏi sư phụ của mình, mang theo một tờ hôn ước đi tới thần đô, từ đó mở ra một hành trình quật khởi của nghịch thiên cường giả.', 'đang cập nhật', '2021', 0, 'HD', '24', 4, 9, 0, 'https://animehay.club/upload/poster/1643.jpg', '', 37, '37', 'Ngừng'),
(119, 'Yasuke', 'Yasuke', 'FULL', 3, 'Anh đến từ châu Phi và chiến đấu sát cánh lãnh chúa phong kiến hùng mạnh trong thế kỷ 16 đầy bạo tàn ở Nhật Bản. Họ gọi anh là Samurai đen và anh trở thành huyền thoại.', 'đang cập nhật', '2021', 0, 'HD', '24', 4, 9, 0, 'https://animehay.club/upload/poster/3254.jpg', '', 6, '6', 'Ngừng'),
(120, 'Gibiate', 'Gibiate', 'FULL', 3, 'Câu chuyện xảy ra ở Nhật Bản. Vào năm 2030, Trái Đất đã hoàn toàn sụp đổ bởi dịch bệnh mang tên \"Gibiate\" sẽ biến những người nhiễm bệnh trở thành quái vật dựa theo độ tuổi, sắc tộc, giới tính.\n\nMột samurai và ninja từ thời Edo đã vô tình du hành thời gian và đến với Tokyo đang sụp đổ để trợ giúp vị tiến sĩ tìm ra phương thuốc cho loại virus này.\n\nCùng nhau, họ chiến đấu chống lại lũ quái vật Gibiate, bọn tội phạm, và những kẻ thù ngăn cản họ trên con đường cứu rỗi nhân loại.', 'đang cập nhật', '2021', 0, 'HD', '24', 4, 9, 0, 'https://animehay.club/upload/poster/3073.jpg', '', 12, '12', 'Ngừng'),
(121, 'Bakumatsu: Crisis', 'Renai Bakumatsu Kareshi Gaiden, Bakumatsu Second Season, Bakumatsu 2nd Season', 'FULL', 3, 'Mùa thứ 2 của anime Bakumatsu', 'đang cập nhật', '2021', 0, 'HD', '24', 4, 9, 0, 'https://animehay.club/upload/poster/2976.jpg', '', 12, '12', 'Ngừng'),
(122, 'Kochouki: Wakaki Nobunaga', 'Kochouki: Wakaki Nobunaga', 'FULL', 3, 'Bộ này là một bộ phim lịch sử thẩm mỹ và mạnh dạn chuyển thể cuộc sống của Oda Nobunaga ở tuổi thiếu niên cho đến khi trở thành lãnh chúa chống lại anh trai của mình, Nobuyuki. ', 'đang cập nhật', '2021', 0, 'HD', '24', 4, 9, 0, 'https://animehay.club/upload/poster/2856.jpg', '', 12, '12', 'Ngừng'),
(123, 'Gintama.: Shirogane no Tamashii-hen 2', 'Gintama.: Shirogane no Tamashii-hen 2', 'FULL', 3, 'Gintama phần 6', 'đang cập nhật', '2021', 0, 'HD', '24', 4, 9, 0, 'https://animehay.club/upload/poster/2582.jpg', '', 14, '14', 'Ngừng'),
(124, 'Angolmois: Genkou Kassenki', 'Angolmois: Genkou Kassenki', 'FULL', 3, 'Vào thế kỷ XIII, sức mạnh quân sự của đế quốc Mông Cổ đã bành trướng khắp các quốc gia phương Tây lẫn phương Đông.\n“Mông Cổ – đó chính là nơi vị vua sẽ huỷ diệt thế giới (Angolmois) xuất hiện!” ― Nostradamus\n―Nửa sau thế kỷ XIII, nanh vuốt của quân Mông Cổ đã hướng đến đảo quốc Nhật Bản.\nNăm 1274, nhà Nguyên phái 3 vạn quân liên minh với Cao Ly cùng 900 chiến thuyền vượt biển sang xâm lược Nhật Bản, dân gian gọi là “Genkou” (Nguyên Khấu – Cuộc xâm lược của nhà Nguyên). Cuộc xâm lược bắt đầu tại đảo Tsushima với những cuộc thảm sát dã man và hủy diệt khủng khiếp. Đây là câu chuyện về những samurai cùng những con người bất khuất trên đảo chống lại ách xâm lược của quân Nguyên Mông.', 'đang cập nhật', '2021', 0, 'HD', '24', 5, 10, 0, 'https://animehay.club/upload/poster/2591.jpg', '', 12, '12', 'Ngừng');
